R["oh__@dara_shadowmane"]="{['Version']=1773,['na']={[71]={['C']=1.021000,['O']=18855,['N']='Inspiration House',['D']='I am re-opening this house (lost all Fx and slowly adding them back).  I may have changed an effect or two, in case you have visited before.  Please read the book at the beginning if you want the backstory for the house.  Enjoy and thank you for visiting.',},[9]={['C']=1.021000,['O']=18755,['N']='Mathiisen House',},[42]={['C']=1.002000,['O']=18870,['N']='Celebrate True Love',['D']='I am re-opening this house (lost all Fx and slowly adding them back).  This was for a Valentine\\'s Day contest sponsored by StabbityDoom.  Please follow her on Twitch (Twitch.tv/stabbitydoom).  She is a great housing streamer. ',},[11]={['C']=1.026000,['O']=20007,['D']='Hello and welcome, this is my attempt to re-create a main quest location in Southern Elsweyr.  Thank you for visiting.',['N']='Five-Claw Station',},[77]={['C']=1.036000,['O']=18843,['N']='Sir Socks Snow Globe',['D']='I am re-opening this house since I lost all of my Fx.  I made a few minor changes and added a category.',},[78]={['C']=1.026000,['O']=20002,['N']='TES:V Re-creation',['D']='',},[15]={['C']=1.017000,['O']=19439,['N']='Garden House Tour 3',['D']='Hello and welcome to the last stop on my Garden House Tour. This is a progressive build with Snugpod and Bouldertree Refuge starting the tour, in \\rthat order. I hope you enjoy the build and thank you for visiting. ',},[48]={['C']=1.041000,['O']=19125,['N']='Whiterun/Breezehome',['D']='Welcome and feel free to look around.  {Please use the stairs.} This is my rendition of Whiterun from ES V:Skyrim and includes Breezehome.  It isn\\'t a perfect replica but I like it.  This is the second of my replica builds (Proudspire manor from ES V is my other build).  I hope you enjoy it and thank you for visiting.',},[49]={['C']=1.020000,['O']=19406,['N']='The Little Farm',['D']='I am re-opening this house. I may have made slight changes if you have visited before.  I hope you enjoy the build and thank you for visiting.',},[19]={['C']=1.002000,['O']=18757,['N']='Best ESO Invention',},[22]={['C']=1.024000,['O']=18870,['N']='Guild Coffeeshop',['D']='I am re-opening this house.  Welcome to my coffeeshop.  This is the very first house I decorated.  Enjoy and thank you for visiting.  \\nPS: there is an \"easter egg\" so look carefully.',},[23]={['C']=1.026000,['O']=18875,['N']='Khargorcian Classic',['D']='LOCATION! LOCATION! LOCATION!\\nWhat more could a young, upwardly mobile Khajiit/Argonian want. Boasting a 1 bedroom, 2 kitchen (inside and out) living space. Close to shops and fine dining. (You can enter the house if you angle  at the door) Thank you for visiting.',},[57]={['C']=1.026000,['O']=18873,['N']='Five-Finger Emporium',['D']='I am re-opening this house (lost all Fx and slowly adding them back).  Welcome to the 5-Finger Emporium.  Please start your tour at the dock and thank you for visiting.  This house could also be used for RP.',},[14]={['C']=1.017000,['O']=19440,['N']='Garden House Tour 2',['D']='Hello and welcome to the second stop on my Garden House Tour. This is a progressive build with Snugpod and The Gorinir Estate being the start and end of the tour, respectively. There are portals connecting the 3 houses. I hope you enjoy the build and thank you for visiting.',},[81]={['C']=1.021000,['O']=19131,['N']='Grand Mountain Lodge',['D']='Welcome, check-in and stay for the weekend. Thank you for visiting. {forced 1st person view when ascending the ramp and stairs on the right side.  A return portal is located at the back of the platform if you don\\'t want to go down the stairs/ramps.} There are 24 Fx, please email me if you don\\'t register that number.',},[80]={['C']=1.026000,['O']=19407,['N']='Irnskar\\'s Folly',['D']='Re-opening this house. They say build what you know. This is an immersive pvp build. The main players are AD and EP but DC is present and they all think they are in Cyrodiil. (There are 3 books to read if you want to know the build\\'s backstory.) Feel free to use for roleplay or dueling(please be respectful to the NPCs). You should see 52 Fx, if not then please email me. Thank you and have fun.',},[62]={['N']='Sil-Var Monastary',['O']=18855,},[13]={['C']=1.017000,['O']=19439,['N']='Garden House Tour 1',['D']='Hello and welcome to the first stop on my Garden House Tour.  This is a progressive build with Bouldertree Refuge and The Gorinir Estate being the next stops on the tour, in that order.  There are portals connecting the 3 houses.  I hope you enjoy the build and thank you for visiting.',},},['Key']='oh__@dara_shadowmane',['TS']=1728673464,}"
