R["oh__@drpeppermd87"]="{['Version']=1773,['Key']='oh__@drpeppermd87',['TS']=1728454267,['na']={[40]={['D']='\"When Topal Bay Island went up for sale, I snatched it up in a hurry. I am a business woman after all and this fixer upper (with a dark history and rumors of missing guests) has been my absolute favorite (and most profitable) project yet. Adventurers are eager to solve the mysteries of Topal Bay while enjoying the luxurious all-inclusive resort. (Warning: Guests MUST travel in pairs! Do NOT leave the safety of guest quarters without your weapon!)\"',['N']='Topal Bay Island',['O']=19770,['C']=1.018000,},[47]={['D']='~Boys and girls of every age~\\n~Wouldn\\'t you like to see something strange?~\\n~Come with us and you will see~\\n~This, our town of Halloween!!!~\\n',['N']='Halloween Town',['O']=19658,['C']=1.038000,},[94]={['O']=20005,['N']='Super Mario Land!',},[80]={['D']='\"Maybe Christmas (he thought) doesn\\'t come from a store. Maybe Christmas perhaps means a little bit more.\"- The Grinch\\n\"And what happened then? Well, in Whoville they say, that the Grinch\\'s small heart grew three sizes that day.\"',['N']='Whoville',['O']=19719,['C']=1.022000,},[46]={['D']='Handbook for the Recently Deceased: In case of an emergency, draw a door and knock three times. Take a number and have a seat. Your caseworker will be with you eventually. ',['C']=1.038000,['O']=20005,['N']='BEETLEJUICE!!!',},[71]={['D']='\"If you\\'re in the area, please stop by and check on my neighbor while I\\'m away. She\\'s a druid of the Stonelore Circle, so as long as you refrain from chopping down her trees or harvesting plants for profit, she will gladly welcome you into her home. Let\\'s just say that she is prone to \"accidents\". Her talents have ironically hindered her ability to preserve the very land she seeks to protect. I\\'ve put out one too many fires that began with the lightning she enjoys tossing around so carelessly!\"',['N']='Druid Getaway',['O']=19770,['C']=1.021000,},},}"
