R["oh__@meg423"]="{['na']={[59]={['D']='',['C']=1.051000,['O']=19577,['N']='Meg\\'s Main <3',},[71]={['D']='Welcome to the Three Alliances Arboretum! Located in Elsweyr, this open air arboretum showcases the distinct gardens of Tamriel...from lava flows to deserts, snowy landscapes to flower meadows and beyond.',['C']=1.021000,['O']=19577,['N']='3 Alliance Arboretum',},[30]={['D']='Welcome to TomeGoods! We offer a library/study as well as an alchemy shop in the main building, with a coffee shop/bakery to the left of the main entrance. Sip and enjoy your favorite tome and sweets on one of the many benches in the surrounding gardens. Don\\'t forget to visit our Dark Arts section, exclusive for those who have a more curious, adventurous nature.',['C']=1.025000,['O']=19533,['N']='TomeGoods',},[70]={['D']='',['C']=1.010000,['O']=19828,['N']='Angels Guild Hall',},[47]={['D']=' a macbre hotel with a minimum required stay of FOREVER. Drop your luggage and enjoy our lobby, complete with serene seating areas and a feast for partiuclar appetites. We have three standard suites, and one presidential suite upstairs to fit your spookiest desires. Our staff kindly asks for patience while we renovate the rear courtyard (don\\'t worry about the gravesites, it isn\\'t bad luck to remove them, right?) ',['C']=1.023000,['O']=20001,['N']='Haunted Hotel',},},['Key']='oh__@meg423',['Version']=1773,['TS']=1728140135,}"
