R["fx__na__@mahvirnadas__9"]="{['Effects']={[1]={['Id']=2272,['X']=27652,['Y']=4096,['Color']=153299,['EffectType']=909,['Z']=50654,['Contrast']=2.180000,['SizeZ']=150000,['SizeX']=150000,['Yaw']=0,['SizeY']=150000,['Pitch']=0,['Roll']=0,['Alpha']=1,['Groups']=512,},[2]={['Id']=2277,['X']=27373.292179,['Y']=13157,['EffectType']=8503,['MetaData']={['message']='Transcribe of Expeditionary Group \\n\\nAefrankil: \"What does it say next?\"\\nFalbeanil: \"I dunno it shows a person standing next to the fire and then just... pieces? In the fire?\"\\nA: \"Pieces of what?\"\\nF: \"I dunno... Maybe food? Do Daedra eat?\"\\nA: \"Hmmm... Well, what do you got in your pack?\"\\nF: \"Uh let me see. Bread, fried tomato, cheese wheel, cheese wheel... dried meats...\"\\nA: \"Well... ok, see this piece here looks like a cheese wedge... lets try that.\"\\n\\n(They spend several minutes upending their bags. Bags which I spent a great deal of time packing carefully. One of the cheese wheels has rolled into the bushes.  They haven\\'t noticed. What have I done to deserve this assignment?)\\n\\nF: \"Daedric rituals sure are strange.\"\\nA: \"You can say that again.\"\\nF: \"Daedric rituals sure are strange? Is that part of the ritual?\"\\nA: \"What?\"\\nF: \"What?\"\\n\\nScribe\\'s note: This is almost certainly a vault that dealt in the torture of \\'mortals\\'.  I\\'m not sure where these food-centric theories are coming from but I\\'m not being paid enough to correct them. Not that they\\'d even listen.',['title']='Scribe\\'s Notes 3',},['SizeZ']=30,['Z']=58350.862411,['SizeX']=26.456456,['Contrast']=1,['Yaw']=0.584685,['Color']=527398,['SizeY']=30,['Pitch']=4.712564,['Roll']=0,['Alpha']=1,['Groups']=2,},[3]={['Id']=2278,['X']=29441.334312,['Y']=13284,['EffectType']=8503,['MetaData']={['message']='Transcribe of Expeditionary Group\\n\\nFalbeanil: \"Hey Frank, is that... a skeleton up there in that cage?\"\\nAefrankil: \"Huh... yeah it sure is. What\\'s that about you think? Their mascot?\"\\nF: \"Mascot?\"\\nA: \"Yeah like... a jester but they\\'re proud of it.\"\\nF: \"Haha! What if it was a worker, but it didn\\'t do good enough work? Like, that\\'s the time-out corner?\"\\nA: \"Time-out corner? And then what, they just left it there and vanished?\"\\nF: \"Yeah! Like that time Vanus locked up and forgot he sent us to organize the undercroft, then left for a month.\"\\nA: \"Oh yeah... that\\'s just like Vanus.\"\\n\\n(Ten minutes have now been wasted while they say \"Vanus\" over and over with increasing disdain. Now I know why Marilyn looked so relieved when she heard I\\'d gotten this assignment instead.)\\n\\n(They are now pronouncing the \\'A\\' in \\'Vanus\\' differently. Three save me.)\\n\\nA: \"Let\\'s not tell VAnus about this place til we get it up and running.\"\\nF: \"Yeah... He\\'ll just take all the credit if we tell him now.\"\\n\\nF: \"We should try and make the mascot more cheerful.\"\\n\\nScribe\\'s note: Request a transfer to another city\\'s guild as soon as possible.',['title']='Scribe\\'s Notes 2',},['SizeZ']=30,['Z']=58487.510883,['SizeX']=26.456456,['Contrast']=1.060000,['Yaw']=4.871214,['Color']=839995,['SizeY']=30,['Pitch']=4.712564,['Roll']=0,['Alpha']=1,['Groups']=2,},[4]={['Id']=2279,['X']=26694.373182,['Y']=13130,['EffectType']=8503,['MetaData']={['message']='Transcribe of Pie Making Expeditionary Group\\n\\nAefrankil: \"Hey Bean. What do you think these things are called?\"\\nFalbeanil: \"Good question... Hmm. That ritual book didn\\'t say.\"\\nA: \"Maybe... Pieces... Piece... Piece-ahs? Peace-aahs. After the picture in the book?\"\\nF: \"Piece-ahs?  Peeaaaase-aaahs.\"\\nA: \"Peeese-aaaaahs!\"\\n\\n(I\\'m not writing all of this down, they\\'ve been shouting that word at each other for several minutes now.)\\n\\nF: \"Peease-ahah ah aaaahs! Peas-ah.\"\\nA: \"No... never mind. We ruined it. We\\'ll just call them Daedric pies.\"\\nF: \"Oh duh, that works.\"\\n\\nScribe\\'s note: I can\\'t tell if they\\'re idiots or geniuses. Idiot geniuses?  The pies are remarkably good, (I washed the torture racks while they slept) and yet, I woke up this morning to the two of them trying to dare each other to taste the lava. I don\\'t know how they made it past Apprentice.\\n\\nI\\'m going home to Vvardenfell to join the Armigers.  I don\\'t think the Mages Guild is for me. ',['title']='Scribe\\'s Notes 5',},['SizeZ']=30,['Z']=58872.604137,['SizeX']=26.456456,['Contrast']=1,['Yaw']=5.047492,['Color']=418198,['SizeY']=30,['Pitch']=4.712564,['Roll']=0,['Alpha']=1,['Groups']=2,},[5]={['Id']=2280,['X']=28379.299967,['Y']=13170,['EffectType']=8503,['MetaData']={['message']='Transcribe of Increasingly Ridiculous Expeditionary Group\\n\\nAefrankil: \"Hey Bean, look at this.\"\\nFalbeanil: \"Whats that? A shelf?\"\\nA: \"It\\'s got a crank, see! Duuude... I think it\\'s a fancy cheese shredder.\"\\nF: \"No way... We\\'re on the right track then!  One of the pieces in the book WAS cheese!\"\\nA: \"Hand me that cheese wheel, lets try it out.\"\\nF: \"Here, try the tomato too, it looks like it\\'s got sauce stains on it!\"\\n\\n(Oh no. No no no. Oh they\\'re not even going to wash it first.)\\n\\nScribe: \"Guys I really don\\'t think-\"\\nF+A: Not now Nilos, we\\'re on to something here!\"\\n\\nScribe\\'s Note: I guess they\\'re onto something. My name\\'s not even Nilos, but there\\'s no one else here. I really thought they were hazing me. Clearly I\\'ve died and gone to Coldharbour.\\n\\nF: \"Why\\'d you think they needed two cheese graters?\"\\nA: \"Maybe they had a lot of cheese?\"\\n\\nScribe: \"The other one\\'s obviously for sausage.\"\\nF: \"Oh DUH! Great Catch Nilos.\"\\nA: \"Yeah good job Nilos.  We\\'ll credit you in our research on this!\"\\nScribe: \"Please don\\'t.\"\\nF: \"Nonsense.  FRANK! Go grab the sausage!\"',['title']='Scribe\\'s Notes 4',},['SizeZ']=30,['Z']=60257.918377,['SizeX']=26.456456,['Contrast']=1,['Yaw']=1.933825,['Color']=607998,['SizeY']=30,['Pitch']=4.712564,['Roll']=0,['Alpha']=1,['Groups']=2,},[6]={['Id']=2281,['X']=27614.347661,['Y']=5370,['EffectType']=8503,['MetaData']={['message']='              DONT     DEAD\\n              OPEN     INSIDE',['title']='WARNING',},['SizeZ']=50,['Z']=53758.167114,['SizeX']=46.456456,['Contrast']=1,['Yaw']=6.211627,['Color']=848699,['SizeY']=50,['Pitch']=0,['Roll']=0,['Alpha']=1,['Groups']=2,},[7]={['Id']=2282,['X']=26224.566893,['Y']=5162,['EffectType']=8503,['MetaData']={['message']='I tried to advise them to take what they \\'learned\\' here and open a shop somewhere with 100% less lava, but they wouldn\\'t hear it.  \\n\\n\"The authentic experience will draw customers in.\" they said.\\n\\nIt appears they too are leaving the mages guild to pursue making these pies.  Maybe I\\'ll check back in a year to see if they\\'re still alive.  Though, after being dragged to see the mural they made at the entrance... Maybe they\\'re more resourceful than they appear.',['title']='Scribe\\'s Notes 6',},['SizeZ']=30,['Z']=54376.612055,['SizeX']=26.456456,['Contrast']=1,['Yaw']=3.256784,['Color']=396299,['SizeY']=30,['Pitch']=4.712564,['Roll']=0,['Alpha']=1,['Groups']=2,},[8]={['Id']=2283,['X']=29461.831464,['Y']=13411,['EffectType']=8503,['MetaData']={['message']='Transcribe of Expeditionary Group\\n\\n(Am I supposed to be writing this all down word for word? All they\\'ve said since we\\'ve arrived is \\'wow\\' over and over, like some sort of deranged echo. Though to be fair this is the most they\\'ve said the entire trip here. Dead silent til they snuck into the ruins without me and told me to stay with our gear til they needed me.)\\n\\nFalbeanil: \"Oh wow!\"\\nAefrankil: \"Wooooow!\"\\n\\n(Does the Mages Guild haze apprentices?)',['title']='Scribe\\'s Notes 1',},['SizeZ']=30,['Z']=52227.897305,['SizeX']=26.456456,['Contrast']=1,['Yaw']=3.450516,['Color']=486899,['SizeY']=30,['Pitch']=4.712564,['Roll']=0,['Alpha']=1,['Groups']=2,},},['TS']=1726944783,['Version']=1773,}"
