R["oh__@mahvirnadas"]="{['TS']=1726864430,['Version']=1773,['Key']='oh__@mahvirnadas',['na']={[1]={['O']=19074,['D']='Deep in the depths of The Mara\\'s Kiss Public House, with an icon that lies far too close to the wayshrine, is a small mysterious room known only to a few unlucky souls. Secrets Swept away, dirt disappears in alarming numbers, only the stains of something like dinner remain.\\n\\nGather your ally and race against time to thwart the dust denizens that threaten the patrons of this unassuming inn.',['N']='The Broom Closet',['C']=1.044000,},[6]={['O']=18751,['N']='Alchemist\\'s Alcove',['C']=1.021000,},[8]={['O']=19481,['D']='A Hodge-Podgey sort of tavern.\\n\\nFX is optional \\'lore stuff\\' (should be 6-ish)\\n\\nBrought to you by the Guild of Daedric Tavern owners stuck on Nirn.',['N']='Hostel Inn-tentions',['C']=1.024000,},[9]={['O']=19504,['D']='A pair of very High Elves and their beleaguered scribe delving for the Mages Guild discover an abandoned Daedric torture vault and accidentally invent pizza.  \\n\\nHaving drastically misinterpreted the tools and runes they set to work repairing it to full functionality.  They\\'re beyond delighted to find it appears to be a hitherto unknown sort of bakery.\\n\\nTrying to trick myself into doing a more \\'modern\\' house.\\n\\nIt\\'s not working.\\n\\nFX very recommended for lore books and credits. (should be 9)',['N']='Doomvault Stykker',['C']=1.024000,},[10]={['O']=19085,['D']='Repaired tumbledown tower reminiscent of the coven cottage house.\\n\\nReach/Solitude themed reskin',['N']='Stone-Tree Moor',['C']=1.017000,},[11]={['O']=19155,['D']='A recreation of \\'Painting of Gryphon Nest, Elegant\\'.\\n\\nInspired by the quest \"A Brush with Death\" in Elder Scrolls IV: Oblivion.  I wanted a painting you could step into.\\n\\nBest visited during the day, I think... It\\'s kind of always raining.',['N']='Gryphon Nest ',['C']=1.031000,},[13]={['O']=19166,['D']='A very small cluttered hut in a forest clearing.\\n\\nNobody:\\nMe: I bet I can fit a tiny house inside of this tiny house. ',['N']='Conjurer\\'s Hermitage',['C']=1.031000,},[15]={['O']=19022,['D']='A quiet secluded monastery.\\n\\nI wanted to do something BIG to celebrate my 40th house.  Turns out putting 400 trees in a 600 slot house makes for more lag than I bargained for.  So here\\'s somewhat of a reskin of Gorinir Estate instead. Featuring some architecture based on a certain mercenary fortress in the Hinterlands, DAI. \\n\\nCheers!',['N']='Forest Monastery',['C']=1.017000,},[16]={['O']=19773,['D']='This was meant to be a joke house that I didn\\'t have to think too hard about.  \\n\\nI proceeded to then think way too hard about it. \\n\\nTheme is: I live under a rock.  What would that rock have to look like to make me never want to leave.',['N']='Rock I live under',['C']=1.025000,},[17]={['O']=19279,['D']='A modest tavern/inn.\\n\\nThe Crooked Crow\\n* * * *\\nThe proprietor appears to be a sort of daedra, though when asked denies it (very unconvincingly).  Clean establishment, extensive list of spirits, modest lodgings.  The food was better than expected, though it seems no matter what you order you\\'ll receive some sort of soup, or mashed potatoes... which the owner vehemently defended as a sort of soup, and that \"Mortals love soup, that is what you ordered.\" Would visit again. Cautiously.',['N']='The Crooked Crow',['C']=1.024000,},[19]={['O']=19112,['D']='A very small Ayleid ruin.',['N']='Nenwenaya Twyll',['C']=1.026000,},[22]={['O']=19179,['D']='A (mostly) Daedric tattoo parlor.\\n\\n\\n',['N']='Jack of all Shades',['C']=1.500000,},[23]={['O']=19169,['D']='A windmill house.\\n\\nA white stone/Leyawiin reskin. Small colorful garden. \\n\\nYou ever get an idea you just can\\'t shake until you make it real?  That\\'s this house.  Haphazardly made a windmill house in another home and decided I needed one purpose-made.  Mostly finished, missing some stuff I don\\'t have unlocked yet.',['N']='Ald-Tar-Vindur',['C']=1.021000,},[24]={['O']=19245,['D']='A medium somewhat lived-in Dwemer ruin.\\n\\nThe lower reaches of this ruin have long since been closed off and lost to time. However, the mechanisms below must still function as the water garden above still thrives. \\n\\nThank goodness for the new dwarven furnitures, I\\'ve wanted to do this for ages.',['N']='Nzelkngthand',['C']=1.026000,},[25]={['O']=18954,['D']='A (loosely) Lore inspired small Daedric Vault.\\n\\nAnd reason #27 I can\\'t afford nice things.',['N']='Nezzokar\\'s Sanctuary',['C']=1.026000,},[26]={['O']=19414,['D']='Based on the lore book \\'Liminal Bridges\\' and a remake of an older house of mine of the same name, (Mathiisen).  \\n\\nShould be at least 30 FX, very recommended but not required.\\n\\nDark Anchor Inspired by Redmoonga\\'s \\'Dolmen 3.0\\'',['N']='A Ritual Gone Wrong',['C']=1.026000,},[29]={['O']=19420,['D']='The home and study of an unassuming vampire that misses the sun, and has learned to simulate it through textile, magical, and botanical means.\\n\\nI fell down a hole of Lo-fi and \\'ambiance\\' videos and this is the result.\\n\\nShouldn\\'t be any fx. (previous build had a bunch)',['N']='The Sunset Estate',['C']=1.025000,},[32]={['O']=19149,['D']='A small climate-controlled satellite laboratory of the Everwound Wellspring specializing in the cultivation of various mushrooms.',['N']='Arboretum Agaricum',['C']=1.021000,},[33]={['O']=19201,['D']='An overgrown castle at the edge of the Faelands.\\n\\nI just wanted an excuse to do some chaotic gardening.  Part castle, part garden, part homage, and an afterthought of a tavern/inn.  Mostly done, just unsurprisingly ran out of both gold and mats.\\n\\n\"It\\'ll just be a facade it won\\'t be that expensive.\"\\n\"Oh wow, I have 300 slots left, I could make the castle accessible!\"\\n*Turns out pockets* \"Oh no... why...\"\\n\\nInspired by Dalentarth in Kingdoms of Amalur',['N']='Lakewatch Keep',['C']=1.017000,},[34]={['O']=19283,['D']='A cramped market alley featuring a blacksmith and a relic shop.',['N']='Market Alleyway',['C']=1.041000,},[36]={['O']=19309,['D']='A small cove.  \\n\\nRuins built on ruins, it seems this somewhat secluded beach has changed hands many times.  For now at least it is occupied by a \\'sometimes\\' pirate with a penchant for collecting banners.\\n\\nAn elaborate excuse to empty my pockets of weird furniture.',['N']='Heculion\\'s Hideaway',['C']=1.031000,},[37]={['O']=19887,['D']='Really just wanted to play with the new furniture.\\n\\nBest visited when it\\'s not raining, but it\\'s always raining.',['N']='Path of Autumn',['C']=1.033000,},[38]={['O']=19442,['D']='A Sea Stack mushroom tower.\\n\\nBecause I tried making a cute little seaside cottage I could over-clutter, couldn\\'t figure out a roof, and kept adding floors until it no longer mattered.\\n\\nDruidy/Darkelf custom structure, original house is hidden.  Light on clutter because I don\\'t know when to stop.',['N']='The Sea Stack',['C']=1.031000,},[39]={['O']=19233,['D']='A somewhat blasphemous center of learning dedicated to sharing the light of knowledge with darker creatures.\\n\\nSpecial thanks to @Xaulas without which this build would not have been possible.\\n\\nNon-loadbearing fx, mostly for flavor/lore/fun',['N']='College of Dun-Ruhn',['C']=1.025000,},[104]={['O']=19745,['D']='When you\\'ve lived in the same house for 20 years and the landscaping is finally starting to do what you want, but your furniture no longer matches.  When you have more books than bookcases and you\\'ve long since given up on putting them back where they belong.  When you swear it rains way more often than it did when you moved in, and you haven\\'t used your patio in weeks.  \\n\\nOh, and it\\'s about time for a new roof.\\n\\nI\\'ll finish this when/if I can afford heartwood again.',['N']='Brzeg',['C']=1.042000,},[41]={['O']=19790,['D']='I guess this ramen shop\\'s got ghosts. Reuploading to try and clear old FX. I don\\'t even know if that works.  People are seeing portals and text and other things from 6 months ago or more and they should not be there. \\n\\nAdded 2 hidden fx to try and I don\\'t know, chase away the old. Please either disregard fx or turn it off when visiting if you can.',['N']='The Other Shore',['C']=1.043000,},[43]={['O']=19582,['D']='...Hora Fugit.  An attempt at an arcanists sanctum.\\nRe-uploading because I sorta fixed one thing that was bothering me, but it still needs some work... eventually.\\n\\nShould be 14 FX and having them enabled is preferred to view this house as intended.  Time literally flies while here in study. ',['N']='Tempus Volat',['C']=1.025000,},[78]={['O']=19737,['D']='Part 2 of \\'Anima Armamentarium\\' \\n\\nBecause I decided my volcano house needed an improbable basement.  50% of the build is out of bounds. Dwemer/clockwork/arkthzand themed.\\n\\nShould be at least 6 FX (invisible item triggers) all the switches in the house \\'should\\' control something, lights, lava etc.',['N']='The Caldera',['C']=1.027000,},[47]={['O']=19553,['D']='A lonely cathedral adrift on one of Coldharbour\\'s many floating islands.\\n\\n[mildly updated]',['N']='Bastion Lamentis',['C']=1.017000,},[80]={['O']=19522,['D']='Part 2 of \"The Sea Stack\" \\n\\nThe expansive Underwater, Underground, Undercroft of a Telvanni mage.\\n\\nPoorly planned shrine to Telvanni hubris. Partial library... nestled between lava and water. Y\\'know, best place to keep books.',['N']='Sea Stack Undercroft',['C']=1.025000,},[70]={['O']=19954,['D']='Tried to build a wizard\\'s tower.  Got a mildly magical mill house instead.\\n\\n\\n\\nShould only be 1 fx, just an informational book.\\nMostly done, but needs some work.',['N']='Vault of Sunflowers',['C']=1.017000,},[111]={['O']=19986,['D']='A small seaside hamlet featuring a tavern and a coffee shop.',['N']='Strand\\'s End',['C']=1.041000,},[90]={['O']=19901,['D']='The abyss has a nightlife district.  Most places are exclusive, closed to you. However, The Naraku’s doors are open wide. (1FX)',['N']='The Naraku',['C']=1.043000,},[75]={['O']=19711,['D']='Based on the Shadow-Cursed Lands in BG3. \\n\\nDone but needs refining because I literally built this in the dark. Should be 2 FX (eventually more) recommended but not required.',['N']='Old Reithwin Docks',['C']=1.041000,},[103]={['O']=19854,['D']='The Cavern of Autumn. \\n\\nThe magic that once fed an expansive artificial oasis has dwindled and grown wild, the elements thrown out of balance. However, a drop of Autumn beauty remains amid this Ayleid ruin. \\n\\nThere\\'s an approximately 2% chance of death*.  If you feel aggrieved a (single) soul gem is available upon request.\\n\\n*Depending on height, weight, whether or not you\\'ve eaten recently, and skill at falling.  1 soul gem redeemable per person. No further injury will be compensated.',['N']='Garlas Morilatta',['C']=1.026000,},[58]={['O']=19964,['D']='The perfect suite for those who need to sleep in the highest possible spot in a room.  Cat friendly. (redone with furniture from this decade)',['N']='Auri-El Suite',['C']=1.500000,},[59]={['O']=19342,['D']='Druid inspired residence\\n\\n(ie. I bought a house, had weird anxiety about trying to decorate it normally, gave up and made it a cave.)\\n\\nIt was a little rushed so I\\'ll be fiddling with it for a while.  Oh and there\\'s an hourglass to play with. Will add lore fx eventually.',['N']='Tirn na Caedven',['C']=1.021000,},[48]={['O']=19968,['D']='There should be no visible fx.',['N']='Dark Harvest Gala',['C']=1.033000,},[71]={['O']=19568,['D']='The home of my crafter inside the remains of a long dormant volcano (mostly).  \\n\\nI decided his Black Vine Villa needed 50 more slots, so I built my own.  Should be 7 FX (eventually more) but it\\'s just light switches and lore books.',['N']='Anima Armamentarium',['C']=1.027000,},[62]={['O']=19297,['D']='A somewhat lived-in Ayleid ruin.\\n\\nHad to move this build from a different house, so its sort of a repost, but configured differently with an additional room.  ',['N']='Naril Alasil',['C']=1.026000,},[110]={['O']=19956,['D']='The myriad realms of revelry, pocket realms belonging to Sanguine that cater to the visitors desires.  Sometimes the simplest most unassuming fantasies are the ones that ensnare you the deepest.',['N']='The Volatile Vintner',['C']=1.026000,},},}"
