R["oh__@xcentricone"]="{['Version']=1773,['na']={[16]={['O']=19953,['N']='Daggerfall Workshop',},[41]={['D']='Earthtear Necropolis. Sepulchral cliffside tombs, abandoned(?) Ayleid temples, and a hidden cozy home with all the amenities high above it all in the cavernous ceiling! Be sure to check out the southwest cavern for the FX testbed.',['C']=1.043000,['O']=19983,['N']='Earthtear Necropolis',},[103]={['D']='Captain Nemo\\'s Secret Submarine base deep beneath the sands of the Alik\\'r desert is accessed by a clandestine underground river connecting to the sea. The sub has all the amenities of home, boasting everying a smuggler... *ahem*... merchant... might need in his world-wide travels!',['O']=19948,['C']=1.015000,['N']='Secret Submarine ',},[107]={['D']='The Willowpond Treehouse is a visually stunning yet fully functional 4-level home with terrace, viewing platform, 2 bedrooms, bar, and workshop, alll overlooking a beautiful pond (with creepy alcoves and climbing paths) an intriguing cave and hilltop temple. Explore to your heart\\'s desire!',['O']=19947,['C']=1.021000,['N']='Willowpond Treehouse',},[47]={['D']='The Hollow City Aerodrome was inspired by steam-punk culture and Jules Verne\\'s \"20,000 Leagues Under the Sea,\" with the Nautilus reimagined as a flying machine! The zeppelin boasts 3 levels, with the Captain\\'s quarters, crew quarters and galley on the top floor, salon and engine room on the 2nd level, and pilot house on the bottom level. Colharbor has to get their supplies somehow, and with all those chasms and daedra, an airship is the way to do it!',['O']=19948,['C']=1.027000,['N']='HollowCity Aerodrome',},[99]={['D']='The Fairwinds Seagoing Cabaret features crew quarters that open up to a theater, world-class kitchen/buffet, library, shipboard doctor\\'s office, gaming area, ship\\'s brig, and even a public lavatory (so you won\\'t have to visit the \"poop-deck!\")\\n\\nBe sure to also check out the Captain\\'s quarters and the \"aft raft!\"',['O']=19947,['C']=1.015000,['N']='Fairwinds Cabaret',},[70]={['D']='The Hall of Xcentricities boasts an ecclectic collection of memorabilia, curiosities, and ancient artifacts from all over Tamriel and beyond. Be sure to visit the nearby village and waterfront, including the lakeside temple and enchanted waterfall!',['O']=19948,['C']=1.030000,['N']='Hall of Xcentricity',},[7]={['D']='Blackvine View is the traditional villa reimagined as a tower, boasting a stunning view of the river, nearby ruins, a daedric dolmen, and a military encampment from the lofty terrace and even loftier enchanted shrine and meditation room.',['O']=19948,['C']=1.048000,['N']='Blackvine View',},},['Key']='oh__@xcentricone',['TS']=1726555059,}"
