n for \\nthe lockdown. That way, when Ol� Joe comes by wondering\\nwhy the soda machine isn�t working, he�ll know not to mess\\nwith it, lest he wants to be zapped into a glowing ghoul.',},['Alpha']=1,['Z']=98547.446480,['Contrast']=1,['EffectType']=4402,['Pitch']=0,['SizeX']=208,['Id']=1318,['Roll']=0,['X']=85795.758645,['Color']=0,['SizeZ']=49,['Y']=12263,['SizeY']=49,['Groups']=0,['Yaw']=2.893756,},[77]={['MetaData']={['message']='@tparesq',},['Alpha']=0.700000,['Z']=97190.692562,['Contrast']=3.380000,['EffectType']=4402,['Pitch']=0,['SizeX']=77,['Id']=1319,['Roll']=0,['X']=96391.961323,['Color']=293134,['SizeZ']=21,['Y']=12310,['SizeY']=21,['Groups']=0,['Yaw']=5.410521,},[78]={['MetaData']={['message']='Vault-Tecs Golden Rule: \\n   Always Look Good!\\n',},['Alpha']=1,['Z']=98608.556797,['Contrast']=1,['EffectType']=4402,['Pitch']=0,['SizeX']=208,['Id']=1320,['Roll']=0,['X']=85893.604885,['Color']=0,['SizeZ']=42,['Y']=12230,['SizeY']=42,['Groups']=0,['Yaw']=6.049311,},[79]={['MetaData']={['message']='    The world might have ended, \\n but your fashion sense does not.\\nA well-crafted piece of jewelry can \\nlift spirits, raise your standing,\\nand maybe even get you out of a \\ntight spot. So shine bright, dear\\n Dweller, and let everyone know\\n that no amount of radiation can\\n        dull your sparkle!\\n\\n',},['Alpha']=1,['Z']=98608.016798,['Contrast']=1,['EffectType']=4402,['Pitch']=0,['SizeX']=168,['Id']=1321,['Roll']=0,['X']=85891.679164,['Color']=40404,['SizeZ']=122,['Y']=12150,['SizeY']=122,['Groups']=0,['Yaw']=6.049311,},[80]={['MetaData']={['message']='11',},['Alpha']=1,['Z']=101290.333495,['Contrast']=1,['EffectType']=4401,['Pitch']=0,['SizeX']=78,['Id']=1322,['Roll']=0,['X']=85712.577274,['Color']=204242,['SizeZ']=95,['Y']=11067,['SizeY']=95,['Groups']=0,['Yaw']=6.126106,},[81]={['Alpha']=1,['Z']=104130.462962,['Contrast']=1,['EffectType']=881,['Pitch']=0,['SizeX']=660,['Id']=1323,['Roll']=0,['SizeZ']=740,['Color']=996205,['X']=85829.364419,['Y'