R["oh__@dreadfathersithis"]="{['Key']='oh__@dreadfathersithis',['eu']={[56]={['C']=1.010000,['N']='Silent Sanctuary GH',['D']='The official guildhall of Winter Rose, part of Rose ESO, the largest social guild on PC EU!',['O']=19954,},[81]={['O']=19335,['N']='Everwinter Hall',['D']='The party\\'s in full swing, so come on in!\\n\\nWelcome to Everwinter Hall. Eat, drink, and be merry!\\n\\nHappy New Life Festival!',['C']=1.036000,},[71]={['O']=19523,['N']='House of Troubles',['D']='Hidden away deep in the mountains of Tamriel lies a temple unknown to the civilised peoples. Dedicated to not one, but all sixteen Daedric Princes. A neutral ground where cultists from across the land come to worship and perform their profane rites. Woe to the explorer that stumbles upon this accursed place...',['C']=1.037000,},[96]={['O']=19295,['N']='Grymvald Manor',['D']='Welcome to Grymvald Manor! Home of the esteemed surgeon, antiquarian & adventurer: Edvard Grymvald. \\n\\nThe museum of rare antiquities can be found on the third floor. Please take care and do not handle the exhibits - many are old, fragile, and sometimes cursed.\\n\\nThe annex is strictly private. Please do not enter!',['C']=1.023000,},[39]={['O']=19356,['N']='Mephala\\'s Embrace',['D']='Mephala! Webspinner! Teacher of the Secret Arts! Queen of the Eight Shadows of Murder! Though others may reign over us, deep in the night we still hear your whisper!\\n \\n... And we do not forget.\\n\\nWelcome to Mephala\\'s Embrace...\\n\\nThe tower is one. The strands are eight. The lessons are forever...',['C']=1.023000,},[47]={['C']=1.003000,['N']='The Dreamers\\' Maze',['D']='Mora\\'s Maze of Madness welcomes you!\\n5 books are scattered across the first 2 floors of the maze. Find them and take note of what you find, and then ascend the tentacles to the final puzzle and the winner\\'s platform in the sky...',['O']=19861,},},['Version']=1773,['TS']=1724087911,}"
