R["oh__@jadekin"]="{['Version']=1773,['Key']='oh__@jadekin',['na']={[104]={['N']='Crypt Keepers Domain',['O']=19641,},[106]={['C']=1.008000,['D']='The Collective is assembling beneath the watchful eye of Mora—Resistance is Futile! Explore the Clockwork gantries and combat cube concealed below. Watch your step or you may fall into the mind prison. It\\'s not all bad down there, it has a Tales of Tribute table to pass the eons. ',['N']='Assimilation Sanctum',['O']=19782,},[91]={['C']=1.037000,['D']='Encounter tributes and titillation within the concealed halls of this ancient Khajiiti temple turned smugglers\\' oasis. Three passageways lead to a Tales of Tribute den and brothel. ',['N']='Temple of Desires',['O']=19771,},[63]={['C']=1.050000,['D']='Step into the Snowglobe Atomic Retreat – a modern home with a fusion of atomic age aesthetics and winter charm. Explore sleek, retro-futuristic interiors and experience a unique twist – every visit is an experience that lets you take something with you...radiation exposure.',['N']='Pocket Reactor',['O']=19734,},[45]={['C']=1.021000,['D']='A vision of apocrypha comes to Tel Galen that offers a fascinating blend of Telvanni architecture, natural caves, and the eerie presence of necromantic energy, making it an intriguing and atmospheric location for adventurers to explore. Looking forward to your visit.',['N']='Thanatopolis',['O']=19528,},[70]={['N']='Temple of Dark Moons',['O']=19686,},[103]={['C']=1.032000,['D']='The \\'Old World Wall\\' is inspired by the Fallout series. This home sees a shanty town community spring up within the dried basin of the Hoover Dam. Careful around the \\'Pit.\\'',['N']='Hoover Dam New Vegas',['O']=19945,},},['TS']=1723261510,}"
R["fx__eu__@djuske__47"]="{['TS']=1723222443,['Version']=1773,['Effects']={[1]={['Yaw']=1.555088,['X']=77437.911864,['Contrast']=4,['SizeY']=500,['Id']=1130,['SizeZ']=500,['Y']=37341,['EffectType']=5085,['Roll']=0,['SizeX']=1066.666667,['Groups']=0,['Alpha']=0.500000,['Pitch']=0,['Z']=91062.496245,['Color']=999998,},[2]={['Yaw']=0,['X']=0,['Contrast']=1,['SizeY']=100,['Id']=1132,['SizeZ']=100,['Y']=0,['EffectType']=614,['Roll']=0,['SizeX']=100,['Groups']=0,['Alpha']=1,['Pitch']=0,['Z']=0,['Color']=494949,},[3]={['Yaw']=4.297001,['X']=89105.019161,['Contrast']=1,['EffectType']=8501,['SizeY']=42,['Id']=1135,['SizeZ']=42,['Y']=37156,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='Dearest Araxti,\\n\\nyour request took me off-guard, I must say. But since we are old friends, I did a little digging and found an unlikely match for you. \\n\\nWhen you asked me about security, I was a bit baffled, since you\\'re already employing that titan. But you\\'re right, they lack a certain finesse. And they\\'re dumb as bricks. Which is why I am putting forward the names of Keros and Ampharexo. Spiderkith both, of Mephala though you perhaps wouldn\\'t think so. They have a very Sheogorean air about them, which is to say they are insufferable pranksters. Perhaps they reflect a hitherto unknown facet of Mephala? It\\'s not for me to speculate; I\\'m an information broker, not a scholar. Allow them access to your mansion, and they will certainly find every weak spot in your security. \\n\\nKeros also juggles when the mood strikes him.\\n\\nJust remember to make it worth their while. And don\\'t let them in the kitchen if you want your mortal guests to survive dinner.\\n\\n\\n\\n- W',['title']='A letter that smells faintly of lavender',},['Pitch']=1.647591,['Z']=91104.224384,['Color']=998094,},[4]={['Yaw']=5.393067,['X']=89215.782890,['Contrast']=1,['EffectType']=8501,['SizeY']=30,['Id']=1136,['SizeZ']=30,['Y']=37159,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='To the masters of Sanguine\\'s Martial Arena,\\n\\nI have learned of your search for a master of coin. The pay is acceptable. I will start in one Tamrielic week.\\n\\nRegards,\\nWatcher Am of Apocrypha',['title']='A letter in impeccable handwriting',},['Pitch']=1.570971,['Z']=91034.139012,['Color']=102439,},[5]={['Yaw']=3.747222,['X']=89873.976730,['Contrast']=1,['EffectType']=8501,['SizeY']=30,['Id']=1138,['SizeZ']=30,['Y']=37326,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='Raxti,\\n\\nyou haven\\'t spoken to me in centuries, and now you\\'re suddenly asking me to come work for you?\\n\\nYou are right, I am the finest chef in the myriad realms, and if simply stating that was an attempt at flattery you\\'ll have to do much better.\\n\\nI want fifty bottles of your finest wine.\\n\\nMazken Trakzan of the Thousand-Course Feast',['title']='a food-stained letter',},['Pitch']=1.570971,['Z']=91901.436629,['Color']=779298,},[6]={['Yaw']=2.089159,['X']=90494.236870,['Contrast']=0.750000,['EffectType']=8501,['SizeY']=30,['Id']=1142,['SizeZ']=30,['Y']=37188,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='Champions of Sanguine\\'s Arena:\\n\\nPerthan Tecothalpaz, Spiral Skein\\n\\nHarvester Gorathan, Coldharbour\\n\\nXivilai Asamin, Deadlands',['title']='plaque',},['Pitch']=4.433136,['Z']=88527.954338,['Color']=205599,},[7]={['Yaw']=0.471239,['X']=89118.333065,['Contrast']=2.040000,['EffectType']=8501,['SizeY']=30,['Id']=1145,['SizeZ']=30,['Y']=37158,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='Esteemed masters of the Arena,\\n\\nI am Callo, at your service. I learned through some acquaintances of your search for a daedric armorer. You\\'ve not heard of me, I\\'m sure. That is because I spent an inordinate time disembodied, trapped in a piece of armor myself - that did leave me uniquely equipped to handle armor, though! Who can mend daedric armor better than someone who spent some time trapped in it? No one, that\\'s who.\\n\\nLooking forward to your offer of a permanent position.\\n\\nMazken Callo',['title']='a tidy letter',},['Pitch']=4.712564,['Z']=91039.908411,['Color']=102439,},[8]={['Yaw']=3.632030,['X']=89310.561782,['Contrast']=1,['EffectType']=8503,['SizeY']=90,['Id']=1179,['SizeZ']=90,['Y']=37257,['SizeX']=66.456456,['Roll']=0,['Alpha']=0,['Groups']=0,['MetaData']={['message']='Coming matches:\\nTecothalpaz v. Gorathan\\n1: 3/5 - X: 18/1 - 2: 20/27\\n\\nJenalta v. Asamin\\n1: 13/2 - x: 20/1 - 1/12\\n\\n\\nSeason\\'s champion:\\nTecothalpaz            -  4/5\\nGorathan                 -  9/4\\nAsamin                    -  4/1\\nJenalta                    -  49/4\\nTalvazare                 - 55/3\\nZiro                          - 70/2\\nFroki Thunderbeard - 344/1',['title']='odds',},['Pitch']=0,['Z']=90781.111896,['Color']=718497,},[9]={['Yaw']=2.530727,['X']=88247,['Contrast']=1,['EffectType']=8503,['SizeY']=130,['Id']=1180,['SizeZ']=130,['Y']=37241,['SizeX']=106.456456,['Roll']=0,['Alpha']=0,['Groups']=0,['MetaData']={['message']='\\n\\nMortals really do slap anything and everything on their frail bodies for protection, don\\'t they? Reminder: read up on \"iron\".\\n\\n-\\n\\nMistress Livia came around to inspect the forge. I asked her about mortal physiology. She said the middle part is the squishiest. Revolting. I\\'ll have to remember that for later.\\n\\n-\\n\\nSome mortal got angry and demanded to know why we are called \"Dark Seducers\" when I declined his rather crude advances. I told him, that is not what we\\'re called, and the tamrielic scholars who called us that apparently need to get out more. Thought of several cooler things I could have said after the fact. I\\'ll save them for later.\\n\\n-\\n\\nAsamin came around today. He is pleasant enough as far as Deadlands Xivilai go. Much prefer them to Coldharbour Xivilai, that\\'s for sure. Come to think of it, don\\'t Xivilai pair up? Wonder who he\\'s paired with. Purely professional interest, of course.\\n\\n-\\n\\nThe titan evicted someone today. Arena matches are one thing, but is there anything better than watching a mortal get thrown off a very tall cliff to its inevitable doom? I think not.\\n\\n',['title']='Callo\\'s notes',},['Pitch']=1.570971,['Z']=93434,['Color']=201227,},[10]={['Yaw']=5.387831,['X']=89771.138975,['Contrast']=1,['EffectType']=8503,['SizeY']=30,['Id']=1181,['SizeZ']=30,['Y']=37327,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='Esteemed mistress Livia,\\n\\nthis is a letter of complaint. Specifically, about my mortal coworker \"Aunt Celia\". I understand this mortal has some mysterious connection to you, but I will bring you this complaint nonetheless.\\n\\nThis mortal keeps disheveling my notes. I have a more than acceptable margin of error of 0.005%, but this number will rise exponentially alongside her transgressions. She is also unable to keep her desk tidy, and I cannot get her to stop saying \"oh no, here comes the eyeball party pooper\" whenever I enter the room and it is humiliating.\\n\\nRespectfully,\\nWatcher Am',['title']='letter of complaint',},['Pitch']=4.712564,['Z']=91727.303435,['Color']=102439,},[11]={['Yaw']=3.640757,['X']=89188.594268,['Contrast']=1,['EffectType']=8501,['SizeY']=71,['Id']=1203,['SizeZ']=71,['Y']=37262,['SizeX']=47.456456,['Roll']=0,['Alpha']=0,['Groups']=0,['MetaData']={['message']='\\nCompleted matches:\\n\\nOctavian Octavianus v. Jenalta\\n1: 13/4  X: 33/1  2: 5/4\\nWinner: Jenalta\\n\\nTecothalpaz v. Thunderbeard\\nWinner: Tecothalpaz\\n1: 1/6  X: 120/1  2: 344/1',['title']='results',},['Pitch']=0.087266,['Z']=90849.956034,['Color']=102439,},[12]={['Yaw']=4.410447,['X']=86044.467156,['Contrast']=2.420000,['EffectType']=4407,['SizeY']=34,['Id']=1245,['SizeZ']=34,['Y']=37056,['SizeX']=60,['Roll']=0,['Alpha']=0.350000,['Groups']=0,['MetaData']={['message']='Livia Servius\\nMistress of \\nthe Arena',},['Pitch']=0,['Z']=90120.421074,['Color']=543730,},[13]={['Yaw']=2.110103,['X']=76970,['Contrast']=1,['EffectType']=4500,['SizeY']=600,['Id']=1254,['SizeZ']=600,['Y']=36935,['SizeX']=600,['Roll']=0,['Alpha']=0,['Groups']=0,['MetaData']={['owner']='@Djuske',['houseid']=37,},['Pitch']=0,['Z']=91021,['Color']=9985,},[14]={['Yaw']=0.595157,['X']=79770,['Contrast']=1,['EffectType']=4500,['SizeY']=600,['Id']=1255,['SizeZ']=600,['Y']=36989,['SizeX']=600,['Roll']=0,['Alpha']=0.250000,['Groups']=0,['MetaData']={['owner']='@Djuske',['houseid']=49,},['Pitch']=0,['Z']=86366,['Color']=990007,},[15]={['Yaw']=0,['X']=84285,['Contrast']=4,['SizeY']=70000,['Id']=1256,['SizeZ']=29500,['Y']=20000,['EffectType']=13,['Roll']=0,['SizeX']=29500,['Groups']=0,['Alpha']=1,['Pitch']=0,['Z']=89920,['Color']=990675,},[16]={['Yaw']=5.874778,['X']=86632.280773,['Contrast']=1,['EffectType']=8503,['SizeY']=50,['Id']=1257,['SizeZ']=50,['Y']=36966,['SizeX']=46.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='\\nIs there a more suitable companion than a mudcrab?\\nIts perfect form, accentuating its function\\nIt nourishes those strong enough to vanquish it\\nand it feeds upon those who are not\\nMudcrabs are the perfect creature\\nI called mine Skitters\\nbecause\\nhe skitters',['title']='Krakzel\\'s Ode to Mudcrabs',},['Pitch']=1.570971,['Z']=91478.816037,['Color']=446699,},[17]={['Yaw']=2.185152,['X']=85665,['Contrast']=1.300000,['EffectType']=8503,['SizeY']=50,['Id']=1258,['SizeZ']=50,['Y']=37048,['SizeX']=66.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='\\n\\nFirst entry:\\nThis place is dumb. The rules are dumb. \"No maiming\"? Really? Why bother fighting if you can\\'t maim your opponent? I can\\'t even tear off one measly finger? And a daedric arena, overseen by a mazken\\'s pet human? Ridiculous concept. One more fight and I\\'m out of here. This isn\\'t worth my time.\\n\\n\\n\\nSecond entry:\\nI stayed for a few more matches. It really doesn\\'t take a lot for these mortals to be impressed, does it? Well, their lives must be sad, short and insignificant as they are. And at least there are no xivkyn here, I couldn\\'t stomach having to play nice with one of those abominations. I guess I can stay for a few more fights, but then I need to get back to the Deadlands.\\n\\n\\n\\nThird entry:\\nI\\'ve been on the front lines of many invasions, and I\\'ve fought enemies more ancient and terrible than can be put into words. I shouldn\\'t care about some stupid, fragile mortals now. Mortals are stupid and insignificant, and impressing them is easy, so this whole arena business shouldn\\'t be this satisfying, right? Right. But when I am in the ring, and I hear them calling my name and cheering for me, even when my opponent bests me? I can\\'t help but get carried away. I will stay for a while longer. Until I grow tired of the crowd\\'s admiration, at least.',['title']='Asamin\\'s journal',},['Pitch']=4.743805,['Z']=93742,['Color']=130850,},[18]={['Yaw']=0.026180,['X']=90896,['Contrast']=1,['EffectType']=8503,['SizeY']=30,['Id']=1259,['SizeZ']=30,['Y']=37299,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='Livia,\\n\\nyou know I love you. That being said, are you aware of how ridiculous it is to receive a letter saying \"I\\'ve made a pact with Sanguine and started an arena in his realm with my daedra boyfriend and I need a bookmaker and I thought of you\"? Did you read the words you put to paper before you sent it? At all? And you still decided to send it? You know what, this is insane, but I\\'ll bite. I accept your offer, you need a proper bookmaker after all, that\\'s not a job you should trust just anyone with. And that way I can keep an eye on you, make sure you\\'re safe, because your self-preservation instict has clearly left your body. I\\'ll await your escort.\\n\\nAunt Celia',['title']='personal correspondence',},['Pitch']=4.712564,['Z']=92549,['Color']=788699,},[19]={['Yaw']=3.199189,['X']=83418.428043,['Contrast']=4,['EffectType']=8503,['SizeY']=61,['Id']=1274,['SizeZ']=61,['Y']=37061,['SizeX']=33.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='\\nIntroduction:\\nThis guide is meant to help mortal newcomers navigate the arena and get the most out of their time here. If you are a daedra reading this, consider locating the daedric version of this guide, as it will make more sense to you.\\n\\nFood and drink:\\nEverything here is free. Eat and drink to your heart\\'s content! \\n\\nBetting:\\nBetting is done through the bookmaker. Any mortals found making bets under the table will be evicted. Check the board next to the bookmaker for odds.\\n\\nDaedra:\\nDo not gawk at the daedra. Do not address them as you would a servant, they are guests and fighters here, same as you. If you are a summoner, you might want to keep that to yourself. If you are doing drinking games, do not challenge a daedra: you will die. Do not antagonise the titan. Give him any reason to evict you, and he will do so with extreme prejudice.\\n\\nTravel:\\nThe arena is surrounded by portals to other daedric realms, most notably Spiral Skein, Evergloam, Coldharbour, Coloured Rooms, Deadlands and Moonshadow. Take care so you do not stumble into any of them. This realm is made with mortal comfort in mind, the other realms are not. Please remember that this is a daedric realm. As such, it is technically illegal to be here according to the laws of most mortal provinces. Therefore, the portal to Tamriel might be unavailable for certain periods of time, for your safety. Some of the guests might tell you this is because Sanguine does not want you to leave; this is a lie. It is purely for your protection.',['title']='leaflet: Tourist\\'s guide to Sanguine\\'s Arena',},['Pitch']=5.173156,['Z']=87859.235562,['Color']=102439,},[20]={['Yaw']=0.769690,['X']=82833.865012,['Contrast']=1.300000,['EffectType']=8503,['SizeY']=50,['Id']=1304,['SizeZ']=50,['Y']=36941,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='\\n\\nIntroduction:\\nThis guide is meant for daedra visiting Sanguine\\'s Arena from other realms. If you are a mortal reading this, consider locating the guide specifically made for mortals, as it will make more sense to you.\\n\\n\\nMortals:\\nMortals are squishy. They are squishy and disgusting and frail, and they have a really unpleasant odour about them. Be careful with them: they perish easily, especially in an inebriated state. You are not to harm any mortals, no matter how little you care for them.\\nThe mistress of the Arena is not a mortal, despite looking like one, smelling like one and acting like one. Do not antagonise her. This is your first and only warning.\\n\\n\\nTravel:\\nThe arena provides fast and safe passage to many realms. The portal to Mundus is strictly off-limits to daedra. If any attempt is made at breaching the compact, the portal will cease to be - and anyone and everyone in the process of travelling will be cast adrift in the void for all eternity. \\n\\n\\nBetting:\\nDaedra are encouraged to use gold for betting, as gold is the preferred currency on Tamriel and in many other realms. We do not accept bets in human souls. This is non-negotiable.',['title']='leaflet: Daedra\\'s guide to Sanguine\\'s Arena',},['Pitch']=4.708898,['Z']=87566.241908,['Color']=638499,},[21]={['Yaw']=1.399754,['X']=91078.031312,['Contrast']=1,['EffectType']=8503,['SizeY']=30,['Id']=1312,['SizeZ']=30,['Y']=37292,['SizeX']=26.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='First entry:\\nAsamin\\'s storyline from hero to villain went over nicely - the crowd got really riled up, and there were a lot of emotions. Several people tried to drown their sense of betrayal in the Dragontail Whiskey.\\n\\nSecond entry:\\nTalvazare wants to join the arena. I\\'ve seen her fight, she is very dramatic, it could work out if she can learn to play along with the other fighters - we\\'ll see, she isn\\'t the friendliest daedra I\\'ve met.  \\n\\nThird entry:\\nI love Talvazare. She is so incredibly unable to play nice, and people love that about her. For her first fight, she came in, just sort of sneered at the audience. Reactions were mixed. But her fight was good, and she plays the angry villain perfectly. She won, to deafening applause, and she took a sip of her drink and spat one of the patrons in the face. It was amazing, the crowd went wild. For her second fight, there were several people calling for her to step on them. This is excellent. \\n\\nFourth entry:\\nTecothalpaz continues to be our most hated villain, so we\\'re going to need additional security around when she\\'s in the ring so some drunk idiot doesn\\'t decide to take matters into their own hands. Drink consumption goes way up when she wins, which is excellent, and people have started hatebetting against her, which is bringing in a lot of money. I have to remember to not let aunt Celia pocket too much of it.\\n\\nFifth entry: (written in a very unsteady hand)\\nwhat bout doin g like a tournam ent where we have a surprise appaeranece but who\\nmaybe i ll ask san guawn\\n\\nSixth entry:\\nI am never drinking with Sanguine again',['title']='Arena storylines',},['Pitch']=4.701917,['Z']=91933.788765,['Color']=102439,},[22]={['Yaw']=3.712315,['X']=82769.579858,['Contrast']=1,['EffectType']=5019,['SizeY']=220,['Id']=1314,['SizeZ']=220,['Y']=36822,['SizeX']=80,['Roll']=0,['Alpha']=0,['Groups']=0,['MetaData']={['message']='Welcome, honored guest, to Sanguine\\'s Arena.',['name']='Gar the Bouncer',},['Pitch']=0,['Z']=87852.638715,['Color']=696968,},[23]={['Yaw']=2.392846,['X']=79720.587502,['Contrast']=1,['EffectType']=4500,['SizeY']=600,['Id']=1345,['SizeZ']=600,['Y']=37221,['SizeX']=600,['Roll']=0,['Alpha']=0,['Groups']=0,['MetaData']={['owner']='@Djuske',['houseid']=90,},['Pitch']=0,['Z']=96459.984765,['Color']=999999,},[24]={['Yaw']=3.712315,['X']=84173.467788,['Contrast']=1,['EffectType']=5019,['SizeY']=220,['Id']=1346,['SizeZ']=220,['Y']=36815,['SizeX']=80,['Roll']=0,['Alpha']=0,['Groups']=0,['MetaData']={['message']='hm... too early for fights... maybe I\\'ll grab a drink inside.',['name']='Sareala the Harvester',},['Pitch']=0,['Z']=90589.201782,['Color']=696968,},[25]={['Yaw']=6.255260,['X']=86132.307774,['Contrast']=1,['EffectType']=4500,['SizeY']=600,['Id']=1392,['SizeZ']=600,['Y']=37057,['SizeX']=600,['Roll']=0,['Alpha']=0,['Groups']=0,['MetaData']={['owner']='@Djuske',['houseid']=13,},['Pitch']=0,['Z']=85288.020129,['Color']=999999,},[26]={['Yaw']=3.492404,['X']=82159.170735,['Contrast']=1,['EffectType']=8501,['SizeY']=70,['Id']=1399,['SizeZ']=70,['Y']=36969,['SizeX']=46.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='\\nHey Gori, nice match today, Tecothalpaz gazed into Gorathan\\'s crimson orbs seductively.\\n\\nThanks Teco, it was a good fight Gori replied. She smiled at Teco.\\n\\nDo you want to take a walk in the garden with me? Teco asked.\\n\\nOkay Gori said, and they walked together outside.Gori was nervous, and felt like her heart would grow wings and fly away from being near Teco, who she really secretly admires, though she tried to hide it as well as she could. But she couldn\\'t hide when they were alone together. Gori looked nervously at Teco, and bit her lip shyly. Teco smiled, and leaned in close to her and\\n\\n\\n\\n\\n\\n\\n[the rest of this page is scribbled over. \"WHAT THE HELL IS THIS GARBAGE\" is written below in a different hand]\\n\\n',['title']='submission to a fan magazine',},['Pitch']=1.570971,['Z']=92997.180657,['Color']=909298,},[27]={['Yaw']=3.525565,['X']=89152.796475,['Contrast']=1,['EffectType']=8501,['SizeY']=50,['Id']=1402,['SizeZ']=50,['Y']=37310,['SizeX']=46.456456,['Roll']=0,['Alpha']=1,['Groups']=0,['MetaData']={['message']='Xelphinkaralthax \\n\\nTitan. He is formerly of the Deadlands, though after Mehrunes Dagon\\'s defeat he ended up in Sanguine\\'s realm - to drink to forget his master\\'s defeat, perhaps. If that is the case he isn\\'t the only one. Not much to say about him, as far as I can tell. He is a titan, there is not much substance there, but if Sanguine has ordered him to guard your human, she will be safe from physical harm.\\n\\n\\nCallo\\n\\nMazken. Has been sealed in a chestplate for the past eon. My inquiries into the whys and wherefores yielded no result, but a subtle approach from one of my informants got us the information - apparently he was guilty of the crime of refusing a demiprince, though of which prince even he couldn\\'t say. He is a very amicable mazken, and I am sure you have already noticed the quality of his work. \\n\\nLivia\\n\\nYes, I put together a dossier on your little mortal as well. You are welcome.\\n\\nInterestingly, the Leyawiin Fighters guild counts her among their dead, as she apparently fell while fighting at one of Bal\\'s anchors. Curious, isn\\'t it, that a supposedly dead associate of the Fighters guild has ended up working for a Daedric Prince? More interestingly, my intel tells me you served Mehrunes Dagon, but you were also killed by one of his Valkyn after turning on them, and only days later, rumours start circulating about a mortal remaking Sanguine\\'s arena, and then, entirely by chance, you rematerialise in Sanguine\\'s realm. Curious coincidence, that I thought was worth mentioning.',['title']='Dossiers',},['Pitch']=1.570971,['Z']=92758.890951,['Color']=201968,},},}"
