R["oh__@djuske"]="{['TS']=1715259035,['Version']=1773,['eu']={[49]={['O']=18911,['D']='Welcome to a quiet and very very safe part of the Evergloam! There is nothing to fear here, travellers! Come, rest, you must be so tired. Would it be so bad if you just... fell asleep? You deserve rest.\\n\\nWhat? No, there are no strange sounds. It\\'s just your imagination running wild again. Just close your eyes for a second. You are safe, I promise!\\n\\n(best viewed at night, with no music and full ambience)',['C']=1.043000,['N']='Evergloam Glade',},[19]={['O']=18994,['D']='Welcome to Madame Sapphire\\'s, the finest jeweller in Mournhold! After long years learning from the best of the best throughout Cyrodiil and Morrowind, she has settled in the homeland, and offers a selection of unique jewelry. Bracelets and rings, necklaces and earrings, Madame Sapphire has it all! And should you want it enchanted, that is easily sorted by Madame Sapphire\\'s own enchanter. Be the center of attention with one of Madame Sapphire\\'s show-stopping pieces today!',['C']=1.025000,['N']='Madame Sapphire\\'s',},[36]={['O']=19133,['D']='Sanguine\\'s Red Rooms, a temple to His worship with a bar, a dance floor, and accomodation for (almost) all tastes. NSFW upstairs, pretty SFW downstairs. A sister build to @agnimhav\\'s Sanguine temple. The Sanguine statue is her frankly genius creation, used with permission. Warning for: drugs, alcohol and sexual references',['C']=1.043000,['N']='The Red Rooms',},[37]={['O']=19106,['D']='This particular corner of Moonshadow has been watched over by the aureal Jenalta for ages untold - she finds mortals so endearing, and will welcome you with open arms. ',['C']=1.043000,['N']='Moonshadow Cove',},[87]={['O']=19852,['C']=1.500000,['D']='After narrowly escaping the invasion of the Imperial City, Nerya moved to Leyawiin, where she lives whenever she isn\\'t fighting in Cyrodiil. ',['N']='Nerya\\'s flat',},[24]={['O']=19826,['D']='A khajiiti Mages Guild somewhere in Elsweyr, accessible to khajiit both big and small. It has a garden for contemplation and ingredient harvesting, a study hall, and accomodations.',['C']=1.020000,['N']='Khajiiti Mages Guild',},[26]={['O']=18987,['D']='A lil yule cottage beside a frozen river, play in the snow or come inside for a nice, hot cup of cocoa :)',['C']=1.022000,['N']='Yule home',},[11]={['O']=18983,['D']='Did you hear about the Enthelwe girl? Apparently she was arrested after she broke into the morgue and tried to resurrect a dead body! I\\'m telling you, the girl\\'s always been very odd. They found her lab in the sewers here, right below Lillandril! And Vinalle says the girl was a vampire on top of everything - can you imagine?',['C']=1.025000,['N']='Lillandril Sewers',},[13]={['O']=19387,['D']='A little room in the Spiral Skein for a spider daedra!',['C']=1.043000,['N']='Spiral Skein Room',},[47]={['O']=18997,['D']='One of Sanguine’s myriad realms, the Martial Arena is dedicated to the art of fighting as entertainment. The masters of the Arena welcome you and your friends, enemies, lovers, or any combination thereof to partake in the fighting, betting, eating and drinking. \\n\\r\\nThere are numerous plaques, letters, notes and books scattered throughout the arena for those interested, but can be enjoyed without effects as well!',['C']=1.043000,['N']='Sanguine\\'s Arena',},[15]={['O']=19133,['D']='Go through the abandoned mine, climb the mountain and speak to Fez\\'ez! ',['C']=1.020000,['N']='Abandoned Mine',},},['Key']='oh__@djuske',}"
