R["oh__@ladytech"]="{['Version']=1773,['na']={[16]={['D']='Welcome to the house of nightmares.  Port into the basement and end in attic.  Always watch your back and look up to prevent getting caught unaware by the creatures that dwell within. Enter at your own risk.  \\nNOTE: the house was too small to make it larger then the 2 floors, but basements and attics are the scariest part of house anyway. ',['N']='Creepy',['O']=19848,['C']=1.023000,},[36]={['D']='Come rest and unwind on the Palatial Spa! Featuring a first class restaurant, bath house, private meditation spots, pool, and more.  Ideal for weddings and large gatherings.  Book you next event now or stop by and try out the exceptional spa facilities.',['N']='Palatial Spa',['O']=19483,['C']=1.014000,},[70]={['D']='This is my crafting home and Primary.  I used all 4 wings.  My main has all normal crafting benching, outfit stations, armory, transmute station, banker, merchant, aetherial well, and 2 different target dummies.\\nI have also built a few additions, a dock, and several peaceful and serene spots to just realx and enjoy the view.  Lots to explore. ',['N']='Rimmen Temple',['O']=19098,['C']=1.500000,},[25]={['D']='Welcome to the Tiny Tavern Inn.  Sit back and enjoy a relaxing meal, or unwind with a drink from the bar.  If you drank a little too much you are welcome to stay the night in one of the beds upstairs.  Enjoy a nice book by the fire or have a little soak in our bathhouse.  Everyone is always welcome at the Inn!',['N']='Baandari House',['O']=19127,['C']=1.041000,},[90]={['D']='Princes Revealed - Immortal 17\\nContains statues and exhibits for ALL 17 Daedric Princes! Explore the large structure and the courtyards.  Read the many books of daedric lore. Don\\'t forget to cross the bridge before you leave!  A wayshrine has been installed for your convience, just see attendant.',['N']='The Immortal 17',['O']=19491,['C']=1.030000,},[11]={['D']='Ample Manor Farm is now open.  Enjoy the peace and tranquility of the rural farm life!',['N']='Stormhold House',['O']=19238,['C']=1.021000,},[75]={['D']='Now open for business, this bustling seaside market features a wide variety of mechant booths and crafting stations, a pub, and  an outlaws refuge.  If you are too tired after your day of shopping there is a lovely boarding house you can stay in as well.  Enjoy your visit at The Seaside Market!  ',['N']='Wrothgar Village',['O']=19182,['C']=1.041000,},[77]={['D']='Welcome to my tiny cave',['N']='Solitude Inn',['O']=19202,['C']=1.043000,},[80]={['O']=19476,['N']='Narnia',},[64]={['D']='Originally built by the ancient Argonians, Xanmeer pyramid was built on top of a sacred spot strong with the forces of natural energies.  Long abandoned and forgotten by the Argonians, Xanmeer was rediscovered by the Druids.  Sensing the strong the forces of nature there the Druids decided it was the perfect spot to honour Mother nature, celebrate and practice Druid magic.  Now, only a few druids make the long pilgrimage to Xanmeer to reconnect with the forgotten peace of true nature.',['N']='Murkmire Pyramid',['O']=19226,['C']=1.031000,},},['TS']=1714878372,['eu']={[10]={['D']='Ever wonder what beings willingly and happily live in poo?  Well stop by and meet the locals.  head out to the courtyard to join the party but watch out for the nosy neighbours.  \\nNOTE: All Items used are items that dropped during the Witches Festival (except for 6 giant mushrooms placed outside the yard).',['N']='Meet the Shroomies',['O']=19627,['C']=1.019000,},},['Key']='oh__@ladytech',}"
