R["oh__@cell'dweller"]="{['Version']=1773,['na']={[32]={['N']='Greyfriars Rectory',['D']='My friend, if you are reading this I may well have met my end. I tried to recreate a watcher, successfully I thought at first but it just wouldn\\'t stop growing! I had to move it when it got too big for the lab. I have managed to distract it with books for now which it seems to absorb, but I know not how long that will sate it. You will find it inside the house. Just... don\\'t get too close!',['C']=1.048000,['O']=19658,},[33]={['N']='The Vernal Vale ',['O']=19539,},[23]={['N']='Shiranui Retreat',['D']='Incorporating the ruins of an old shrine this beautiful venue is the perfect setting for parties, ceremonies or just a quiet getaway break. It boasts al fresco kitchen and dining facilities, space to entertain guests and a comfortable cottage with bathing and sleeping facilities and stunning sunrise views from the balcony. Comes with resident cats! (It is said if they leave the whole place will sink below ground). ',['C']=1.051000,['O']=19408,},[11]={['N']='The Saintly Bull Inn',['D']='The Saintly Bull Inn welcomes you to our verdant little oasis in the swamps of Shadowfen. Enjoy a drink from the bar in our beautiful beer garden or a hearty meal from our buffet table under the pergola. Many a weary traveller is drawn to the comfort of our lights from the fens for a place to eat, relax and rest their head till morning.',['C']=1.021000,['O']=19846,},[72]={['N']='The Black Mausoleum',['O']=19387,},[101]={['N']='The Pleasance',['O']=19606,['C']=1.046000,['D']='Now converted into a stylish and welcoming residence the building still retains some of the grandeur from its days as a state building with most of the statues and plush furnishings left in place. Also left in place was the function suite on the upper floor which now regularly sees the new owner and their guests party into the wee small hours of the night!',},[31]={['N']='The Lucky Leprechaun',['O']=19376,},[39]={['N']='Eternally Aetherial ',['D']='Eternally Aetherial Mortuary and Funeral Home is proud to serve Tamriel in creating the perfect send off for your loved ones. Do not be put off by the intimidating exterior, for inside you will find a serene and tranquil space. Services we offer include embalming, mortician services, cold storage, post mortem examinations, burials, cremation, mummification and a viewing area. We have a beautiful chapel and on site catering. We strive to make every funeral the one your loved ones deserve.',['C']=1.048000,['O']=19719,},},['TS']=1714719208,['Key']='oh__@cell\\'dweller',}"
