R["oh__@kookaburraking0169"]="{['TS']=1711826439,['Key']='oh__@kookaburraking0169',['Version']=1773,['na']={[23]={['D']='Paws and Claws is a Khajiiti Theme Teahouse and Massage Parlour. This is a roleplaying home, managed by a reformed Maomer Arcanist and owned by a Mazken trained Breton-Reachman.\\n\\nJust hit the gong and someone will tend to you.',['N']='Paws and Claws',['O']=19805,['C']=1.014000,},[13]={['D']='Ranger\\'s Retreat\\nOnce the home of Galandir Gul Nighthollow (An RP character of mine, now a Bosmer Zombie) before entrusting it to Aerigail Ulalyh Rosegrove (Bosmer Vinedusk Ranger). Now in her keepsake, she added a second floor.\\n\\nThe home is small but the space is liveable and optimized. A spriggan maid, maintains the home while the ranger is out on missions.\\n\\nThe home teems with the magic of the green. There is an indoor garden and hunting gear adorns the walls of the home.',['N']='Ranger\\'s Retreat',['O']=19806,['C']=1.031000,},[5]={['D']='The Swordsinger\\'s Suite is a little room located in the City of Sentinel within Alik\\'r. It\\'s current occupant, Owyrick B\\'arpte T\\'ufyltha. A former pirate and now a privateer under the employment of the Daggerfall Covenant Fleet. \\n\\nThe home is decorated with knick-knacks and swords from his collection.',['N']='Swordsinger\\'s Suite',['O']=19811,['C']=1.046000,},[77]={['D']='The Skaalian Bard\\'s Room is a college dorm of an RP character of mine named Rygwulf Bearclaw. If it wasn\\'t obvious enough, he is a Skaalian currently studying in the Bard\\'s College here in Solitude. \\r\\n\\r\\nHe has an intense passion for music of all sorts from all over tamriel. He tours the land and keeps song books, singing in Inns, Markets, Theaters, Local and Regional Courts. Charming his way through the land. \\n\\nHe practices Thaumavocalism, Thu\\'um, Frost and Nature Magic. ',['N']='Skaalian Bard\\'s Room',['O']=19811,['C']=1.025000,},[31]={['D']='The Craftmaster\\'s Lodge, is a simple isolated home of a hermit named Borzob. An Orc Hunter, Blacksmith and Dressmaker living in the country of Stormhaven. \\r\\n\\r\\nThe home boasts, his kill and many of the furniture we made from wood, bone, sinew and the skin of his prey. A big foodie and drinker, he also likes to play Tales of Tribute with an old traveling merchant taking stops on his property. ',['N']='Craftmaster\\'s Lodge',['O']=19812,['C']=1.051000,},},}"
