R["oh__@mirue"]="{['Version']=1773,['Key']='oh__@mirue',['TS']=1709796651,['eu']={[71]={['D']='The house on the windy lake. As the night falls, the wind picks up, causing the wooden panels to creak and groan. The sound echoes through the quiet lake, emphasizing the solitude of the house. But despite the eerie noises, the warm glow of the house\\'s lights create a welcoming aura. The lake ripples and dances in the moonlight, and the wind carries the sweet scent of nature. It\\'s a place that feels both secluded and alive, making it the perfect escape from the bustle of daily life...',['C']=1.051000,['N']='At Craft',['O']=19446,},[98]={['D']='Southern white marble villa, made of salty water and wood. It appeared on the sandy shores, once the owner had to bury her somewhat precious friendship.\\nYou can explore the house and be a guest, just be careful when you enter the master room.\\nGod knows what this intolerable girl has grabbed and stored in her own bedroom. Again!',['C']=1.051000,['N']='Last Resort',['O']=19700,},[11]={['D']='A small retreat, hidden on the top of a mountain, in the shadows of swamp. A humble warden lives here, taking care of injured wild animals and nurishing  plants. Everything he needs is provided my mother nature — small indoors garden and fishing spot is enough, surrounded by evergreen trees. Nothting bothers this quite place for now.',['C']=1.031000,['N']='x Ana\\'Eny\\'s heart',['O']=19468,},[78]={['D']='Have you ever wondered if Solitude could offer you something better, than coldstoned walls and rusty old wooden furniture?\\nBuilt fully from scratch, in modern Leyawinn style, this house serves as a shelter for two loving hearts — altmer sorceress and a daughter of Imperial counceler. Small and cozy, this appartment also offers all crafting stations and transmutation machine, but first you have to find it!\\nIn case it would be a problem — just find a white rabbit in the garden and follow his lead.',['C']=1.051000,['N']='Solitude Redone',['O']=19434,},[70]={['D']='Fully redone, this temple now is a shelter for the young arcanist.\\nYou can find all sorts of important things here —  a small Black Reach ecosystem and a herbarium; iron golem in the small garden, to sharpen your battle skills. Enourmous library and even an inside anvil system, build according to the dwemer standards.\\nNot to mention a tube and a vampire corner.\\nWe all have our small hobbies, you know.',['C']=1.051000,['N']='A new home',['O']=19700,},[54]={['D']='Tiny nordic hunter\\'s hut deep in the dark winter forest.\\nAll comments appreciated, since i feel like im missing something in this work. Hope to find out what with the help of the community :>',['C']=1.051000,['N']='Руины в Ротгаре',['O']=19789,},[15]={['D']='Have you ever wondered, how the life would go if Bastian and Isobel somehow would find smth in common?\\nWhere would they live and how would their life be?\\nThis house, built from scretch is my answer to this question :)',['C']=1.047000,['N']='Isobel&Basti\\'s Manor',['O']=19434,},},}"
