he margin]  I trust you know my wards and how to use them.  You will find the original deed in the usual place.  Beware the edge of the stream to the West, it drains into a rather unsavory cave of late.  Nothing to worry about in wet years.  May my home be the refuge you seek, and provide for you well.\\n\\n\\n  To my Granddaughter Thavera Velar, I leave the contents of my account at the bank of Solitude, minus 5 gold and a pair of shoes.  Speak to Veresa Hler if she still works there.  I know the seclusion of the wilds never suited you child, may what I have stored there help you realize your dreams.\\n\\n  To the Crow-Eye Clan, who gave me refuge in a time of great turmoil, I leave my blessings and the possessions I left in your care should I have returned.  May they serve you well with my eternal thanks.  I name my Granddaughter Vivyne as my successor in your affairs, should she accept.\\n\\n  To Jorunn the Skald-King, I leave my recipe for Venison Stuffed Grape Leaves, and an intricate red wool scarf.  He will know why.\\n\\n  To the so called Wolf of Skyrim, Svargrim, I leave a lightly cursed brown hat.  (If you have trouble finding a willing courier, then I suggest you send the letter attached to page 5)\\n\\n         [Continues for many pages]',},['Yaw']=3.574434,['Contrast']=1.940000,['SizeX']=26.456456,['Pitch']=4.712564,['X']=166781.422301,['Z']=158240.580010,['Groups']=0,['Id']=1317,['Color']=622,['EffectType']=8503,['Roll']=0,},[33]={['Alpha']=0.500000,['SizeY']=20,['SizeZ']=20,['Y']=29785,['MetaData']={['target effect']=99990001,},['Yaw']=3.185226,['Contrast']=1,['SizeX']=20,['Pitch']=0,['X']=163429.646675,['Z']=159702.852667,['Groups']=0,['Id']=1320,['Color']=999999,['EffectType']=1020,['Roll']=0,},[34]={['Alpha']=0.500000,['SizeY']=1000,['SizeZ']=1000,['Y']=27750,['Yaw']=0.263545,['Z']=160137.204784,['SizeX']=3000,['Pitch']=1.570971,['X']=154918.995188,['Roll']=0,['Groups']=0,['EffectType']=910,['Color']=999988,['Contrast']=1,['Id']=1329,},[35]={['Alp