R["fx__na__@mahvirnadas__4"]="{['TS']=1691963879,['Version']=1773,['Effects']={[1]={['Yaw']=4.815363,['Y']=10022,['Id']=1642,['SizeZ']=500,['Alpha']=1,['Contrast']=1,['SizeY']=1,['Z']=24271.924375,['X']=23786.966890,['EffectType']=12,['Groups']=1,['SizeX']=500,['Color']=0,['Roll']=0,['Pitch']=4.712564,},[2]={['Yaw']=4.749041,['Y']=10253,['Id']=1643,['SizeZ']=700,['Alpha']=1,['Contrast']=1,['SizeY']=700,['Z']=24278.558156,['X']=23932.713107,['EffectType']=12,['Groups']=1,['SizeX']=720,['Color']=0,['Roll']=0,['Pitch']=0,},},}"
R["fx__na__@mahvirnadas__49"]="{['TS']=1691963701,['Version']=1773,['Effects']={[1]={['Contrast']=1.560000,['SizeX']=26.456456,['Color']=122748,['Roll']=0,['Pitch']=4.712564,['SizeZ']=30,['Id']=1279,['EffectType']=8503,['Yaw']=3.321362,['X']=63999.809018,['Z']=46307.766246,['Alpha']=1,['MetaData']={['title']='Tel Norvayn: A Short History',['message']='   I, Anevi, had inherited this land mostly by accident.  It was seen as a lost cause by the nearby townsfolk, nothing more than an old fortification sinking into the fens.  And as such, none contested the deed that came into my hands.  Even I could not have forseen that this plot of land could become so dearly important to me.\\n\\n   This was little more than my laboratory stuffed into a small stone hut all those years ago, yet it was my home all the same. It remained this way many long years before Nelrinar stumbled into my life, and at least a year more.  I had plans for the derelict foundations of a tower lost to history and ruin, yet never the time to see them through. Though I had long fallen from the obligations of House Telvanni, I once confessed to my unlikely companion my dream of living atop one of those prestigious towers.\\n\\n   Little did I know then, that such an offhanded admittance could be the spark to see my hopes realized. \\n\\n   Suffice it to say that neither of us counted architecture among our varied skills.  Increasingly complicated spells did much of the heavy lifting.  Nelrinar proved to be precisely what I wasn\\'t, utterly charming.  Trips taken into town for provisions were just as likely to amount to large shipments of stone, hewn wooden beams, and often other rarer necessities.  Through trade, bargain or favor, the elf practically skipped through the gate ready to make a present of some new find.\\n\\n   Five iterations it took, years of work inbetween adventures.  Through much trial and error, designs and flaws, mistakes and the loving persistence of the most unusual Altmer I\\'ve ever known... Our home stands here, completed.\\n\\n   May it last both of our long lives.',},['Groups']=0,['SizeY']=30,['Y']=11704,},[2]={['SizeX']=600,['Contrast']=1,['Roll']=0,['SizeY']=580,['SizeZ']=580,['Id']=1597,['EffectType']=4521,['Yaw']=4.686209,['X']=67052.773288,['Z']=49401.651012,['Alpha']=1,['Color']=259965,['Groups']=512,['Pitch']=0,['Y']=10516,},[3]={['Contrast']=1,['SizeX']=40,['Color']=899989,['Roll']=0,['Pitch']=4.712564,['SizeZ']=40,['Id']=2093,['EffectType']=4406,['Yaw']=4.644321,['X']=66982.214444,['Z']=49374.235208,['Alpha']=0.750000,['MetaData']={['message']='O',},['Groups']=2,['SizeY']=40,['Y']=10340,},},}"
