R["fx__na__@mahvirnadas__71"]="{['TS']=1690758030,['Effects']={[1]={['Roll']=0,['Groups']=0,['Yaw']=2.640683,['MetaData']={['will be']='Toggled',['then group furniture']='4730716583156071636,4730716583155909947,4730716583156184883,4730716583156112318,4730716583156183646,4730716583155684147,4730716583155684163,4730716583156131409,4730716583156184411,4730716583156184412,4730716583156184894',['is']='Toggled',['then group']='INSIDE LIGHTS',['when furniture']='4730716583156183560',},['Z']=65937.632504,['SizeZ']=1,['X']=63616.077236,['Alpha']=1,['EffectType']=1010,['Pitch']=0,['SizeY']=1,['Contrast']=1,['Color']=999998,['Y']=29492,['Id']=2311,['SizeX']=1,},[2]={['Roll']=0,['Groups']=1,['Yaw']=2.206096,['MetaData']={['title']='Soot-Stained Note',['message']='I shall return soon, I hope.  In the meantime direct your inquiries to the spider automaton that should be sitting here. Speak loudly and clearly. I mean really YELL, as loud as you can. There\\'s nothing physically wrong with its tonal transcriber, its just stubborn.\\n\\nState your name clearly, the item you wish to have crafted, and where you may be found upon its completion. \\n\\nTo check the status of an already ordered item, please yell STATUS. The automaton might actually show you the ledger. If for some remote reason it begins to shoot sparks, back away slowly and try to look non-threatening.\\n\\nTo accept and pay for a completed item, point to the entry in the ledger (if successfully shown it) and yell the item name.  Once or twice should do. Three willing it will bring you the item you\\'ve requested. Place payment on the desk. Once the amount is sufficient the automaton should release the item to you. Again... try to look non-threatening.\\n\\nIf the automaton attempts to bring you an item you did not request, please shout NO, several times very calmly. Trust me, it is testing you and you do not wish to fail that test.\\n\\nAlso, beware, the automaton has the ability to lock the doors in the event of non-payment. And also... whenever it feels like it.  I cannot stress NON-THREATENING enough. \\n\\nWorst case scenario there\\'s food and water in the back, try to steer clear of the automaton until I return. \\n\\nThree keep you,\\n-Forgemaster Llervas Reloth \\nProprietor of Anima Armamentarium',},['Z']=65933.641582,['SizeZ']=30,['X']=63526.991158,['Alpha']=1,['EffectType']=8503,['Pitch']=4.712564,['SizeY']=30,['Contrast']=1,['Color']=467098,['Y']=29470,['Id']=2312,['SizeX']=26.456456,},[3]={['Alpha']=1,['Groups']=0,['Yaw']=2.452188,['MetaData']={['will be']='On',['then group furniture']='4730716583156183555,4730716583156184884,4730716583156184990',['is']='On',['then group']='spot lights',['when furniture']='4730716583156002069',},['Z']=65808.729759,['SizeZ']=1,['X']=63637.571373,['Pitch']=0,['EffectType']=1010,['SizeY']=1,['Roll']=0,['Contrast']=1,['Color']=999998,['Y']=29492,['Id']=2313,['SizeX']=1,},[4]={['Alpha']=1,['Groups']=0,['Yaw']=3.715806,['MetaData']={['will be']='Off',['then group furniture']='4730716583156183555,4730716583156184884,4730716583156184990',['is']='Off',['then group']='spot lights',['when furniture']='4730716583156002069',},['Z']=65612.893322,['SizeZ']=1,['X']=63932.552875,['Pitch']=0,['EffectType']=1010,['SizeY']=1,['Roll']=0,['Contrast']=1,['Color']=999999,['Y']=29493,['Id']=2314,['SizeX']=1,},[5]={['Alpha']=1,['Groups']=512,['Yaw']=3.434808,['MetaData']={['title']='Note to self',['message']='Thaddeus is mucking about in Nchuthnkarst again... or still is.  Unclear if it\\'s an echo or a new occurence.  Either way, ignore messages of repair requests until it\\'s settled.',},['Z']=68048.231628,['SizeZ']=30,['X']=62478.152520,['Pitch']=0,['EffectType']=8503,['SizeY']=30,['Roll']=0,['Contrast']=1,['Color']=102439,['Y']=29736,['Id']=2315,['SizeX']=6.456456,},[6]={['Alpha']=1,['Groups']=2048,['Yaw']=1.040216,['MetaData']={['title']='Journal Vol. 1',['message']='These pages keep crumbling long before I ever will.  Rewriting this over the ages was once cathartic but now... Perhaps I am only breathing life into the past that haunts me.\\n\\nI remember what it was like to be Chimer.  I remember the bitter oppression of the Nords in Veloth. And though I no longer remember his voice, nor all the words of Nerevar\\'s rallying speech, I remember how it made me feel on the eve of battle. I remember the relief in victory and the 300 years of peace- the only years of my long life that matter.\\n\\nNew though the alliance was, I was given leave to study with the Dwemer, to learn of their magnificent machines and automata. I spent what must have been several decades groveling, appeasing, and apprenticed to as many disciplines as they\\'d be willing to let me take on.  I was but a young man when we liberated my \\'homeland\\', yet 100 years on I had spent more time with the Dwemer than my own people.  Eventually I had not only their respect, but several life-long friendships, my own workshop, and my own apprentices... And a wife.  Of her all I can bear to say is that she was a charming, brilliant woman, and a far better tonal architect than I will ever be.\\n\\nThe next 200 years were the sort of blur that only joy and satisfaction can provide.  Fleeting years compared to everything that followed.  The accounts differ and I know not the truth, only that all Chimer were forced to evacuate. I tried to stay even as I was told that my friends were now enemies.  I was smuggled out of Nchuleftingth by those I cherished, who wished to not see me executed by one side... or the other. Though we managed sparse correspondence in secret, it was the last time I saw her.',},['Z']=67673.302275,['SizeZ']=10,['X']=62115.486923,['Pitch']=0,['EffectType']=8503,['SizeY']=10,['Roll']=0,['Contrast']=1,['Color']=102439,['Y']=29799,['Id']=2316,['SizeX']=6.456456,},[7]={['Alpha']=1,['Groups']=2048,['Yaw']=1.083849,['MetaData']={['title']='Journal Vol. 2',['message']='The war of the First Council did not count me among it\\'s warriors. How could I? To try and join either side, a traitor I\\'d surely be.  Instead I watched from the shadows as best I could. \\n\\nIt was in the midst of that bloodless reconnaissance, unwilling, that I saw what still haunts what few dreams remain to me-  The utter disappearance of an entire Dwemer host... save for their automatons powering onward, suddenly masterless. Wheeling, they ambled as though kites whose strings had been untethered.  I remember the panic, the chaos that spread like wildfire among the Chimer, the fear that whatever befell the Dwemer would fall upon us next.  It was no victory, there was no relief- only a sickening pit of fear and the sort of void an entire people, an entire life, almost everyone I had ever known and the only one who mattered- Remained.\\n\\nThe years that followed were that of darkness, misery.  I wandered through empty cities, searching for anyone, but for her most of all.  Dangerous years they were, war-time defenses were still active, finely tuned complications went without maintenance and verged on catastrophe. I fixed or repurposed what I could, set increasingly wild automatons to fulfill the maintenance people once carried out.  It was in the midst of this that came the day I awoke changed; The first curse.  The moment I reached the surface and saw the totality of the affliction...  I knew what had been meddled with.  It wasn\\'t long before it was made known a new \\'Three\\' replaced the Three of old, at the expense of us all.\\n\\nThough I spat at this new Three, I then resolved I would need to transgress the old. I felt my years upon me, and I would need time, an unnatural amount of it to continue my search and hope to make right what had all gone wrong.',},['Z']=67624.846189,['SizeZ']=10,['X']=62143.941411,['Pitch']=0,['EffectType']=8503,['SizeY']=10,['Roll']=0,['Contrast']=1,['Color']=102439,['Y']=29822,['Id']=2317,['SizeX']=6.456456,},},['Version']=1773,}"
