R["fx__na__@mahvirnadas__8"]="{['Effects']={[1]={['SizeX']=26.456456,['Groups']=1,['MetaData']={['message']='Keep your hands to yourselves.\\n\\n-Management',['title']='A Cautionary Tale',},['SizeY']=30,['Id']=2251,['Color']=406264,['Pitch']=0,['X']=23866.335373,['Z']=22480.627818,['Roll']=0,['EffectType']=8501,['Yaw']=6.166248,['SizeZ']=30,['Alpha']=1,['Contrast']=1,['Y']=20072,},[2]={['SizeX']=12,['Groups']=2,['MetaData']={['message']='D',},['SizeY']=20,['Id']=2252,['Color']=0,['Pitch']=0,['X']=23089.845838,['Z']=21745.580914,['Roll']=0,['EffectType']=4406,['Yaw']=6.072000,['SizeZ']=20,['Alpha']=1,['Contrast']=1,['Y']=20149,},[3]={['SizeX']=81,['Groups']=2,['MetaData']={['message']='For the handsy\\n      xoxo',},['SizeY']=25,['Id']=2253,['Color']=0,['Pitch']=0,['X']=23086.912257,['Z']=21744.953137,['Roll']=0,['EffectType']=4407,['Yaw']=5.995206,['SizeZ']=25,['Alpha']=1,['Contrast']=1,['Y']=20118,},[4]={['SizeX']=46.456456,['Groups']=0,['MetaData']={['message']='Built in 343 2E by Malinir Ael Von Illith Vain Xanthalir \\n\\nMalinir, an exile from the Summerset Isles, had a remarkably poor demeanor and a dark sense of humor. There is no record of what she called this establishment for everyone else knew it as \"The Out\" on account of Malinir\\'s tendency to shout \\'get out\\' a lot for an inn keeper.\\n\\nShe passed in 401 2E and left the establishment to her best worst customer, an Orc with an unpayably high bar tab known only as Grond. This establishment quickly became known as \\'The Stumble Inn\\' as Grond frequently stumbled in late and patrons took turns running the bar themselves.  \\n\\nThe Stumble Inn changed hands several times over the decades, frequently to settle gambling debts.  It was once owned for as little as 3 days by a Breton named Percival the Unlucky. \\n\\nIn 457 2E the Unluckiest Percival lost this establishment to the current owner, the Daedra he clumsily summoned in an attempt to improve his luck.  \\n\\nAzenaxes the self-styled Lord of Ale promptly renamed this establishment \"Hostel Inn-tentions\" though he stresses the name is as good natured as he is, and it remains in his care to this day. ',['title']='A Brief History',},['SizeY']=90,['Id']=2254,['Color']=102439,['Pitch']=0,['X']=23967.030008,['Z']=21873.796118,['Roll']=0,['EffectType']=8501,['Yaw']=5.993461,['SizeZ']=90,['Alpha']=1,['Contrast']=1,['Y']=20229,},[5]={['SizeX']=46.456456,['Groups']=2,['MetaData']={['message']='1. Elbows off the bar.\\n2. Keep your hands to yourself.\\n3. Nonpayment may result in a binding contract.\\n4. Arguments settled at my discretion. \\n5. No summoned minions.\\n6. No summoning of Greater Daedra in an attempt to overrule me.\\n7. No mirrors.\\n8. Keep bodily odors to a minimum or take it outside.\\n9. Attempts to banish me will result in bodily harm.\\n10. Be nice to my cats.\\n11. Anyone caught defacing the furniture will have it tattooed upon them on a body part of my choosing.',['title']='Rules',},['SizeY']=50,['Id']=2255,['Color']=102439,['Pitch']=0,['X']=23540.599213,['Z']=21620.401673,['Roll']=0,['EffectType']=8501,['Yaw']=1.343904,['SizeZ']=50,['Alpha']=1,['Contrast']=1,['Y']=20069,},[6]={['SizeX']=71,['Groups']=1024,['MetaData']={['message']='Azenaxes is \\na himbo',},['SizeY']=29,['Id']=2256,['Color']=0,['Pitch']=4.712564,['X']=23616.995798,['Z']=21455.957568,['Roll']=0,['EffectType']=4407,['Yaw']=5.703736,['SizeZ']=29,['Alpha']=0.660000,['Contrast']=1,['Y']=20777,},},['Version']=1773,['TS']=1683425252,}"
