R["oh__@murmad"]="{['Version']=1773,['na']={[65]={['D']='Where did Josajeh and the wise cracking skull travel after they left Athenaeum? ',['C']=1.027000,['N']='Time Warp',['O']=19353,},[34]={['O']=19467,['N']='Guess the movies!',},[19]={['O']=19468,['N']='Shrine to Stories',},[23]={['D']='Rawl\\'kha Curry House\\nHot and Purrlicious Grand Opening Feb 1 2023.\\nThe Rawl\\' kha Curry House offers tandoori goose, kebab, chapatis hot from our tandoor oven, curry of the day and moon sugar bobble tea. Relax downstairs with a fresh pressed juice.\\n',['C']=1.024000,['N']='Rawl\\'kha Curry House',['O']=19387,},[26]={['D']='Uncle Rose was always kind to me and taught me gardening. H left me, in his will, a fat purse of gold and the family estate. This was some years ago. Now Uncle\\'s roses have grown wild. I don\\'t dare to enter!',['C']=1.038000,['N']='Uncle\\'s Roses',['O']=19424,},[11]={['D']='It is A bath. A birthing pool to be exact. The Bedsit has a nursery room and the ex sort of lives downstairs. The mum, \"Kills with a spoon\" is a single mother. You do the math.',['C']=1.014000,['N']='Dark Horse',['O']=19396,},[15]={['D']='Mammagamma tried everything to cure the tree. Bone spells, dwarven stone humors, elven songs. Golden feather churned to dust.  Blood from virgin Nords and Orcish tusk. Visit Marsippany. Home of the daft elft. ',['C']=1.051000,['N']='Marsippany',['O']=19320,},[31]={['D']='TUSK! \\nOrcish Beauty Parlor for all your needs. We do tusk ornaments, beardos, shaggdos and pedicure. Dull nails? Sharpen them up at TUSK. Balm your sunburn. We have the best ointments. Scalp massage offered. Make your grin the grinniest at TUSK.',['C']=1.044000,['N']='TUSK',['O']=19432,},[14]={['D']='I am Dhim Qui. I catch bugs. I don\\'t see them as pests. They are my friends. A prison is always a prison. That is why I let the little buggers out again and you pay again. Business is good.',['C']=1.031000,['N']='Derwyddon\\'s Tower',['O']=19412,},[95]={['D']='Leonardo\\'s Pizza\\nWood stove pizza take away. Only ten minutes wait. (2 visitors at once only since this is an Inn Room)',['C']=1.024000,['N']='Leonarodo\\'s Pizzeria',['O']=19424,},},['Key']='oh__@murmad',['TS']=1682182975,}"
