R["fx__eu__@mirue__78"]="{['TS']=1679843339,['Effects']={[1]={['Color']=999998,['Y']=16837,['MetaData']={['title']='a worn note',['message']='... dear Miruelly! I wanted to warn you that I have seen a white rabbit in your garden recently. I assume you don\\'t want all these rare plants to be eaten by a mere animal, so I will try to catch it.\\n\\n\\n... yet no luck in finding it. Supposingly it has a hole somewhere in here, but i still was not able to find it and close it.\\n\\n... i wonder, where does it disappear? I could probably follow it?...\\n\\n_________________\\n\\n Миpуeлли! Я хотел пpедупpедить, что недавно заметил в твоем cаду  белого кpолика. Полаг��ю, что ты не хотела бы, чтобы какое-то ничтожное животное уничтожило pедкие pаcтени� в твоем cаду, так что  поcтаpаюcь его поймать.\\n\\nВcё еще не пpеуcпел в поимке. Полагаю, что у него тут где-то еcть дыpа, чеpез котоpую он пpоникает в твой cад. Поcтаpаюcь найти её и закpыть.\\n\\nВcё еще не могу найти, куда же он иcчезает? Возможно, мне cтоит за ним пpоcледить?\\n\\n________________\\n\\n... liebe Miruelly! Ich wollte Sie warnen, dass ich kürzlich ein weißes Kaninchen in Ihrem Garten gesehen habe. Ich nehme an, Sie wollen nicht, dass all diese seltenen Pflanzen von einem bloßen Tier gefressen werden, also werde ich versuchen, sie zu fangen.\\n\\n... noch kein Glück bei der Suche. Vermutlich hat es hier irgendwo ein Loch, aber ich konnte es immer noch nicht finden und schließen.\\n\\n ... ich frage mich, wo verschwindet es? Ich könnte ihm wahrscheinlich folgen?\\n',},['Roll']=0,['SizeY']=30,['Contrast']=2.260000,['EffectType']=8501,['SizeX']=26.456456,['Groups']=0,['X']=74230.430972,['Alpha']=1,['Id']=1005,['Pitch']=4.799655,['SizeZ']=30,['Z']=75151.809512,['Yaw']=4.607669,},[2]={['Color']=995552,['Contrast']=2,['Roll']=0,['SizeY']=500,['EffectType']=1008,['Y']=17104,['SizeX']=500,['X']=73931.942171,['Groups']=0,['Alpha']=0.750000,['Id']=1052,['Pitch']=0,['SizeZ']=500,['Z']=74879.661761,['Yaw']=3.864159,},[3]={['Color']=959595,['Groups']=0,['MetaData']={['title']='Diary',['message']='... i know, you will never read it, even you\\'d be close enough to touch it with your own fingertips. You will never be here again, never again your curly hear would touch the silk of the pillows upstairs. This is the reality now and I have to admit it and move on.\\n\\n... can\\'t make myself forget everything you\\'ve told me and also this silence before you\\'ve left forever. You never dared to explain anything to me, so did I. Could be better if your imperial stubborness would never cross my altmer\\'s pride.\\n\\n... each night here or in Vivec makes me either cry or desperatly look for the blink of your white clothes. The depression takes me deeper and deeper each day. Maybe once i will find enough strength to never return here again.',},['SizeZ']=30,['SizeY']=30,['EffectType']=8502,['Y']=32034,['SizeX']=26.456456,['Alpha']=1,['Contrast']=1.640000,['X']=75715.553965,['Id']=1055,['Pitch']=4.712564,['Roll']=0,['Z']=74666.609673,['Yaw']=4.771730,},},['Version']=1773,}"
