{['Roll']=0,['Y']=28463,['Alpha']=1,['EffectType']=90,['SizeX']=742,['SizeZ']=722,['Yaw']=5.640904,['Pitch']=6.195919,['Z']=95828.297362,['Groups']=0,['Color']=0,['SizeY']=722,['X']=127476.083212,['Id']=1245,['Contrast']=0.400000,},[49]={['Groups']=0,['SizeY']=300,['Y']=19460,['Alpha']=1,['EffectType']=5018,['Roll']=0,['SizeX']=130,['Yaw']=5.120796,['SizeZ']=300,['Z']=105179.255038,['Color']=696969,['X']=108590.964709,['Pitch']=0,['MetaData']={['name']='Boethia\\'s Supplicant',['message']='\"Look upon the face of Boethiah and wonder. Raise your arms that Boethiah may look on them and bestow a blessing. Know that battle is a blessing. Know that death is an eventuality. Know that you are dust in the eyes of Boethiah.\" - Boethiah\\'s Glory',},['Id']=1246,['Contrast']=1,},[50]={['Groups']=0,['SizeY']=130,['Y']=19642,['Alpha']=1,['EffectType']=8503,['Roll']=0,['SizeX']=106.456456,['Yaw']=5.222025,['SizeZ']=130,['Z']=104617.468863,['Color']=953499,['X']=108213.804197,['Pitch']=5.672320,['MetaData']={['title']='Irnskar\\'s Folly Part 1',['message']='\\n\"I crave adventure\", the royal scion of Skyrim, Prince Irnskar, bellowed.  \\n\\nKing Jorunn the Skald-King, overhearing his son\\'s outburst replied, \"Good because I have a task for you\". \"I have received reports of outbreaks of sporadic fighting in a location in Western Skyrim and I am sending you to look into it.\"\\n\\n\"Here is your opportunity to exercise your diplomatic skills but bring this situation under control by whatever means necessary\", Jorunn continued.  \"My Emissary, Rigurt is nearby in case you need some assistance,\" the King added knowing full well the Prince\\'s feelings toward the Nord\\'s unconventional diplomacy.\\n\\n\"Gather your gear, you will leave immediately,\" Jorunn continued, handing Irnskar a map with the destination marked.  Irnskar brushed away a tiny speck, which disappeared with an audible pop, as he took the map.\\nDuring the journey, Prince Irnskar reflected upon his father.  \"Jorunn the Skald-King is the strongest man I\\'ve ever known.  I hope to someday be half the man he is and in time to carry on his legacy.\"  \"Sometimes I suspect I\\'ll never live up to his expectations.\"  Irnskar again brushed away a tiny speck  as he had in the previous days whenever he spoke of his father.  It disappeared with a pop.\\n\\nThe Prince reached Solitude well after dark on the 5th day.  Word had reached the Blue Palace ahead of his arrival and after days of travel and sleeping under the stars, the gates were a welcome sight.  Upon his arrival, he was presented an envelope upon a silver tray.  The Prince took it and read the contents.\\n\\n',},['Id']=1247,['Contrast']=1,},[51]={['Groups']=0,['SizeY']=130,['Y']=19642,['Alpha']=1,['EffectType']=8503,['Roll']=0,['SizeX']=106.456456,['Yaw']=5.222025,['SizeZ']=130,['Z']=104782.690101,['Color']=529964,['X']=108285.966287,['Pitch']=5.672320,['MetaData']={['title']='Irnskar\\'s Folly Part 2',['message']='\"Your Highness, it began, please forgive my absence. I am away tending to matters in Markarth.  Your arrival is somewhat of a surprise nevertheless, I have instructed my staff to provide you with whatever you desire.  Please enjoy your stay, your servant Svanna.\" \\n\\nThe first spark of sunlight could be seen as the Prince readied his mount to depart from the Blue Palace the next morning.  The instructions from his father were clear, intervene as quickly as possible to quell any possible escalating conflict.\\n\\nAfter consulting with the Palace cartographer, Irnskar had a better understanding of the location he was to visit.  It was a remote area, accessible only by dwarven ruins set into the side of a mountain.  As a Nord he was uniquely suited for the frozen landscape he would need to traverse.  Several hours outside of Solitude and to the East of \"\" Irnskar found himself face-to-face with a dwarven metal door.  He opened it and stepped through.\\n\\nHe was greeted by a lit but empty corridor leading to a seemingly empty chamber containing a single but oddly familiar statue.  He continued through to a second metal door.  As he laid his hand upon the door, aether mists formed around him and he vanished with an audible pop.\\n\\n\"Believe me, I want to avoid the throne for as many years as I can.\"  The statement echoed in Irnskar\\'s ears as he materialized in what appeared to be a pocket realm of Oblivion.',},['Id']=1248,['Contrast']=1,},[52]={['Groups']=0,['SizeY']=130,['Y']=19642,['Alpha']=1,['EffectType']=8503,['Roll']=0,['SizeX']=106.456456,['Yaw']=5.222025,['SizeZ']=130,['Z']=104934.181525,['Color']=998841,['X']=108375.387228,['Pitch']=5.672320,['MetaData']={['title']='Irnskar\\'s Folly Part 3',['message']='\\nBeothiah chuckled as she watched the \"little ants\" scurry around the frozen lake. Each faction trying to maintain control of the flag and scroll which had been ported into her realm along wih the lake and the building currently residing there.  \"Little soldiers playing at war\", she thought.  Her plan had worked perfectly to draw in The Skald-King and his heir into her little game.\\n\\n\"Irnskar wants to avoid being King for as long as he can, let\\'s give him a taste of being Emporer\", she snorted,  her laughter fading away.',},['Id']=1249,['Contrast']=1,},[53]={['Roll']=0,['Y']=18973,['Alpha']=1,['EffectType']=892,['SizeZ']=150000,['SizeX']=150000,['Yaw']=0,['Groups']=0,['Pitch']=0,['SizeY']=150000,['X']=117735,['Color']=231117,['Z']=102581,['Id']=1250,['Contrast']=3.440000,},},}"
