R["fx__na__@nyali72__40"]="{['Version']=1771,['Effects']={[1]={['Roll']=0,['Z']=64804.266727,['Alpha']=1,['Color']=197999,['Pitch']=0,['Contrast']=1,['SizeY']=35,['SizeX']=250,['Y']=20003,['SizeZ']=35,['Groups']=0,['MetaData']={['message']='The story of this land starts with these ruins, a once sacred elvish place destroyed through an ancient war with the dwarves.',['name']='The history of war:',},['EffectType']=594,['Id']=1164,['Yaw']=2.330015,['X']=63417.706197,},[2]={['Roll']=0,['Z']=68381.011927,['Alpha']=1,['Color']=197999,['Pitch']=0,['Contrast']=1,['SizeY']=75,['SizeX']=330,['Y']=20015,['SizeZ']=75,['Groups']=0,['MetaData']={['message']='Many moons later, the dwarves and elves made peace.  The dwarves then wanted to help the elves to rebuild their sacred place and taught them how to build homes inside of the mountains, protected.',['name']='The start of peace:',},['EffectType']=594,['Id']=1165,['Yaw']=2.731440,['X']=61418.460062,},[3]={['Roll']=0,['Z']=74370.638016,['Alpha']=1,['Color']=197999,['Pitch']=0,['Contrast']=1,['SizeY']=75,['SizeX']=550,['Y']=20061,['SizeZ']=75,['Groups']=0,['MetaData']={['message']='The building to your left an obvious feat of dwarven architecture was built to protect thee elvish sacred tree of life, the bottom floor is sanctuary and meditation.  The top floor is for council meetings representing both dwarves and elves.  When you look out one side you see the destruction of war, when you look out the other side, you see the beauty of peace.',['name']='Magic and remembrance',},['EffectType']=594,['Id']=1166,['Yaw']=2.649410,['X']=57897.301314,},[4]={['Roll']=0,['Z']=78254.038078,['Alpha']=1,['Color']=197999,['Pitch']=0,['Contrast']=1,['SizeY']=75,['SizeX']=470,['Y']=20039,['SizeZ']=75,['Groups']=0,['MetaData']={['message']='Up these stairs you can gaze upon the magical lagoon, many people have reported healing and euphoric properties from the water.  The phoenix is important to the elvish people and is a reminder that one day they will again take their place with the Gods.',['name']='A magical place',},['EffectType']=594,['Id']=1167,['Yaw']=4.071853,['X']=57716.752540,},[5]={['Roll']=0,['Z']=78791.217276,['Alpha']=1,['Color']=197999,['Pitch']=0,['Contrast']=1,['SizeY']=55,['SizeX']=410,['Y']=20079,['SizeZ']=55,['Groups']=0,['MetaData']={['message']='Though no one is allowed in the upper city, many come to see the beauty that has been accomplished here through peace, so while your here come in and enjoy the market, also don\\'t forget to grab a bite to eat and drink at the bar and grill, its quite delicious.',['name']='Enjoy the market',},['EffectType']=594,['Id']=1168,['Yaw']=2.569125,['X']=55746.953564,},},['TS']=1674578113,}"
