R["oh__@cerulione"]="{['Version']=1771,['Key']='oh__@cerulione',['eu']={[89]={['N']='The Sixth Station',['C']=1.020000,['O']=18870,['D']='Loosely inspired by Studio Ghibli’s Spirited Away, The Sixth Station is an invitation for a journey to the unknown, as well as a call to return to a simpler and more meaningful way of life. Please hand your ticket to the controller to board the train. \\r\\n\\r\\nPS: For optimum experience, a night-time visit is preferred. Please stay on the track for your own safety.\\r\\n',},[43]={['N']='Diagon Alley',['C']=1.020000,['O']=19083,['D']='The iconic wizarding alley from Harry Potter’s Wizarding World Universe. Welcome!',},[28]={['N']='Ruska',['C']=1.050000,['O']=18887,['D']='Located on a height overlooking Nimalten, Ruska is an ode to the autumnal change of colours of the surrounding forest.\\n \\r\\nThis modern style cottage offers a built-in fireplace for those crisp autumn evenings, as well as a kitchen, a mezzanine sleeping area, and a large deck equipped with grill and stargazing telescope. It also features large floor-to-ceiling window and skylight that allows undisturbed view to surrounding forest and the northern light from indoor.\\r',},[94]={['N']='The Mariner\\'s Lodge',['C']=1.018000,['O']=19097,['D']='Nestled at the entrance of Seaveil coral atoll, this sun-blessed abode is said to be under the auspicious protection from the Lady herself. Home to a seasoned sailor and oceanographer, this magically floated home features an undisturbed indoor view to the seabed.\\n\\nInfo: the house is behind the entrance.',},[14]={['N']='Bag End',['C']=1.020000,['O']=19378,['D']='\"In a hole in the ground there lives a hobbit...\"',},[15]={['N']='Woodland Garden',['C']=1.021000,['O']=19368,['D']='Of poetries and wildcrafting.\\nOf old songs and children\\'s tales.\\nOf faeries and magic,\\nand the realm at the bottom of the well.\\nOf garden, trees and flower.\\nOf things we forget when we stop dreaming.\\n\\n(Best time to visit is when the sun is shining)',},},['na']={[95]={['N']='A Room of One\\'s Own',['C']=1.050000,['O']=19369,['D']='A small pied-à-terre for my character in PC/NA, total reskin of the room to luxurious modern Leyawiin style :)',},},['TS']=1674308292,}"
