R["fx__na__@mahvirnadas__10"]="{['Effects']={[1]={['Alpha']=0.620000,['X']=26426.514774,['Pitch']=0,['Groups']=1,['SizeX']=400,['Yaw']=2.312561,['Roll']=0,['Y']=12634,['EffectType']=4521,['Id']=1622,['SizeY']=700,['Color']=187342,['SizeZ']=700,['Z']=37361.280413,['Contrast']=1,},[2]={['Alpha']=1,['Z']=37330.299419,['Color']=879898,['Pitch']=0,['Groups']=2,['Id']=1623,['Yaw']=2.324779,['Roll']=0,['Y']=12773,['EffectType']=4407,['SizeY']=40,['SizeX']=160,['MetaData']={['message']='Portal Hub',},['SizeZ']=40,['X']=26442.560713,['Contrast']=1,},[3]={['Alpha']=1,['Z']=38164.693497,['Color']=679096,['Pitch']=4.712564,['Groups']=64,['Id']=1663,['Yaw']=4.841543,['Roll']=0,['Y']=9465,['EffectType']=8501,['SizeY']=30,['SizeX']=26.456456,['MetaData']={['message']='5th of Sun\\'s Dusk 2E 587 \\n\\nTo my dearest Nalvyna,\\n\\nThe tale of how I ended up here is thrilling to say the least. No doubt as strange as the delivery method of this package- that I have been assured will find it\\'s way to you with great precision. You have my apologies if it was too precise. The fellow that sold me these strange sausages doesn\\'t understand the mortal fascination with food, though he assured me they must be edible. (I am less sure, do be careful).  I will regale you with the entirety of my adventure at length once I see you again. Which, three willing, will be soon.\\n\\nYours in spirit,\\nLlervas Reloth \\n\\nPS: Either these were unreasonably expensive, or I may have bought you deliveries of these for life.  I REALLY hope they are in fact edible.',['title']='Greetings from Fargrave',},['SizeZ']=30,['X']=27900.743892,['Contrast']=1,},[4]={['Alpha']=0.560000,['X']=26758.641762,['Pitch']=0,['Groups']=512,['SizeX']=600,['Yaw']=2.155482,['Roll']=0,['Y']=9532,['EffectType']=4581,['Id']=2169,['SizeY']=600,['Color']=9957,['SizeZ']=600,['Z']=38544.432400,['Contrast']=1,},[5]={['Alpha']=1,['Color']=377199,['X']=27076.543784,['Pitch']=4.712564,['Groups']=0,['Id']=2171,['Yaw']=0.691150,['Roll']=0,['Y']=9451,['SizeZ']=30,['SizeY']=30,['SizeX']=26.456456,['MetaData']={['message']='17th Sun\\'s Dawn 2E 608\\n\\nMy Dearest Llervas,\\n\\n[Several lines crossed out]  My time is near the end. It means the world to [illegible] you would offer such a gift. [scrawled sentence lined through]\\n\\nI cannot accept.  \\n\\n[many holes dot the paper as though stabbed repeatedly with a sharp quill]\\n\\nWhy can\\'t I accept?  I could accept why can\\'t I just.... accept.\\nBut I can\\'t live forever, not like that.  Can I?  I ache, I am old.  I want... rest.  This is unfair.\\n\\n[rest of the draft appears to have been torn off]',['title']='Drafted Letter',},['Z']=37722.690184,['EffectType']=8503,['Contrast']=1,},[6]={['Alpha']=1,['Z']=37878.962659,['X']=26877.675940,['Pitch']=4.712564,['Groups']=1024,['Id']=2172,['Yaw']=1.380555,['Roll']=0,['Y']=9495,['EffectType']=8503,['SizeY']=30,['SizeX']=26.456456,['MetaData']={['title']='Carefully kept letter',['message']='21st of Sun\\'s Dawn 2E 608\\n\\nMy dearest Nalvyna,\\n\\nI am sorry if my offer caused you pain.  I asked for selfish reasons, but I already knew your answer.  On the off chance I was mistaken, I left the choice to you, as only you could make it.  My time with you... I have cherished it greatly, and will continue to do so.  \\n\\nI have another selfish request.  Please, do not go before I\\'m there.  I do not wish for you to be alone when...  I will follow this letter shortly.\\n\\nYours in haste,\\nLlervas Reloth',},['SizeZ']=30,['Color']=627998,['Contrast']=1,},},['TS']=1669690360,['Version']=1771,}"
R["fx__na__@mahvirnadas__6"]="{['Version']=1771,['TS']=1669604223,['Effects']={[1]={['Alpha']=0.250000,['Id']=1586,['SizeY']=500,['Groups']=512,['Roll']=0,['EffectType']=4521,['SizeZ']=500,['Yaw']=5.000368,['Y']=20179,['X']=26829.439707,['Z']=27307.470794,['Color']=539971,['Contrast']=1,['SizeX']=280,['Pitch']=0,},[2]={['Color']=102439,['Groups']=0,['Id']=1588,['SizeY']=30,['Alpha']=1,['Roll']=0,['EffectType']=8503,['SizeZ']=30,['Yaw']=3.139847,['Y']=20140,['Z']=27022.188440,['MetaData']={['title']='Faded Journal',['message']='5th of First Seed\\n\\nShe smiles when she thinks I\\'m not looking.  As much as I delight in that fleeting joy, I love her intimidating scowls even more.  It was an enormous risk for her to take me in, even injured as I was... Yet, she hasn\\'t sent me packing yet. Perhaps she would accept a gift in thanks.  Maybe herbs?',},['X']=25569.961990,['Contrast']=1,['SizeX']=26.456456,['Pitch']=4.625123,},[3]={['Color']=438699,['Groups']=2,['Id']=2170,['SizeY']=40,['Alpha']=0.660000,['Roll']=0,['EffectType']=4406,['SizeZ']=40,['Yaw']=4.998623,['Y']=20078,['Z']=27343.897231,['MetaData']={['message']='O',},['X']=26811.729510,['Contrast']=1,['SizeX']=40,['Pitch']=0,},},}"
