R["oh__@darquinn"]="{['na']={[48]={['C']=1.017000,['O']=19262,['N']='Fort Ragnarsson',['D']='Come visit Fort Ragnarsson! Upon exiting the caves you will find yourself in the mead hall or ancestral crypt. Once exiting either location, you will find the central forge. Once you are at the forge, look for the grand stairs that lead up to Jarl\\'s Crown, the home of Home of Wulfric and Ingara Ragnarsson. A fully custom build from the ground up and the most fun I\\'ve had yet. Hope you enjoy. ',},[41]={['C']=1.017000,['D']='Custom built from the ground up, within a vast cave, Castle Ragnarsson is the home of Wulfric and Ingara Ragnarsson. The castle interiors thirteen rooms include a living room, dining room, kitchen, wine cellar, bath house, treasure room, two guest rooms, master suite, laundry room, childrens room, transmutation lab and workshop. Outside, the courtyard contains a stable and animal pen. ',['N']='Castle Ragnarsson',['O']=19316,},[62]={['C']=1.017000,['O']=19077,['N']='Lumiere Castle',['D']='Visit the newly rebuilt and renamed Castle Lumiere!   The main floor of this huge build contains a sitting room, lounge, kitchen to the right and dining to the left. Head to the rear and up grand staircase up to the central suite. A shrine to Meridia is on the lower level. Upper levels have the crafting hall and library connected by a central terrace. The rear wings are where you\\'ll find the armory and trophy rooms. Drop by and take a tour, also feel free to sign the gestbook if you like.',},[70]={['C']=1.020000,['O']=19316,['N']='\\rQasr Alzaman\\r ',['D']='Qasr Alzaman or The Palace of Time, represents the ever evolving life\\'s work of the Redguard Sorcerer, Aramir Ria\\'hamra and his quest to harness and combine the secrets of Clockwork, Dwemer, Psijic and Daedric magics. Equal parts, palace, machine and magical construct, it\\'s five floors are comprised of a grand entrance, main hall, kitchen, armory, master suite, bathhouse terrace, two guest rooms, rear deck, front terrace and upper observation deck and a workshop laboratory far below. \\r',},[14]={['C']=1.031000,['O']=19060,['N']='Rythvan Hollow',['D']='Come visit Ruthvan Hollow! Forest home of Altmer-Bosmer Warden, Rythvanir. Once inside, head left to see the pool and further to the shrine. Head back and follow the fence up the hill to the crafting terrace, then continue further up to the lookout. Come back down and head through the door into the series of connected caves. Once outside again, head past his steed and hound to additional areas for crafting and camping. Don\\'t miss the waterfall too!',},},['Version']=1771,['Key']='oh__@darquinn',['TS']=1668972667,}"
