R["fx__na__@mahvirnadas__25"]="{['Version']=1769,['TS']=1667522157,['Effects']={[1]={['SizeY']=30,['Alpha']=1,['SizeZ']=30,['SizeX']=26.456456,['Roll']=0,['Id']=1376,['Pitch']=4.719370,['Y']=11439,['Color']=559297,['Yaw']=1.513200,['X']=22460.823920,['Groups']=0,['Contrast']=2,['EffectType']=8502,['Z']=44344.246869,['MetaData']={['title']='Things Arvos Likes',['message']='(roughly scrawled note with several points lined through)\\n\\n1. Books\\n2. Tea\\n3. Wine\\n4. Sleeping\\n5. Snoring\\n6. (crossed out heavily)\\n7. Eating\\n8. Flowers\\n9. Baths\\n10. Pillows\\n11. Warmth\\n12. (illegible)\\n\\n\\n\\n\\n\\n\\n- Remember to make a fire',},},[2]={['SizeY']=30,['Alpha']=1,['SizeZ']=30,['SizeX']=26.456456,['Roll']=0,['Id']=1377,['Pitch']=4.886922,['Y']=12196,['Color']=629399,['Yaw']=1.609194,['X']=22636.227024,['Groups']=0,['Contrast']=1,['EffectType']=8501,['Z']=44642.518197,['MetaData']={['title']='A Note From Arvos',['message']='Dear Nezzokar,\\n   It was incredibly thoughtful that you modified your sanctuary to accomodate me darlin\\', but not even I need 10 tea kettles.\\n\\n   I\\'ll return soon, off to buy more tea.\\n   -Eternally, \\n    Arvos\\n\\nP.S.  I did notice the books. \\nI have SO. MANY. QUESTIONS.',},},[3]={['SizeY']=30,['Alpha']=1,['SizeZ']=30,['SizeX']=26.456456,['Roll']=0,['Id']=1378,['Pitch']=4.708898,['Y']=14737,['Color']=20414,['Yaw']=3.096214,['X']=23008.082654,['Groups']=0,['Contrast']=2.500000,['EffectType']=8501,['Z']=47071.840416,['MetaData']={['title']='Unexpected Progress',['message']='7th of Sun\\'s Dusk\\n\\n   The plants endemic to my home have grown poorly here.  It is perhaps too green, and too wet. Ash infusions proved not enough, and despite my efforts they grew weak and sickly. I expected nothing short of attempting to create lava, or reconnecting my sanctuary to the Deadlands to have any meaningful effect. Though, that last act would draw far too much attention... From too many.  Now, it seems that will be unnecessary.  \\n\\n   During our last expedition Arvos pointed out a most peculiar plant.  It stole my curiosity most completely. He and I took cuttings while I tried to understand what about it seemed so very familiar and why it reminded me of my homelands.  It was not until many weeks had passed, these small luminous plants readily overtaking my sanctuary, did I finally understand why.  \\n\\n   Around every transplant, the Deadland varieties had begun to flourish.  I cautiously suspect these plants naturally give off the same sort of light to that of lava flows in my native realm.  \\n\\n   I am no expert in such things, however I do know caring for these strange plants is much less dangerous than attempting lava.\\n\\n\\n5th of Hearthfire\\n\\n     Arvos had a wild idea.  \\n\\nWe attempted lava.',},},[4]={['SizeY']=1300,['Alpha']=0.320000,['SizeX']=780,['Roll']=0,['Id']=1380,['Yaw']=3.131121,['SizeZ']=1300,['X']=22765.475276,['Y']=15123,['Pitch']=1.570971,['Groups']=1,['Contrast']=1,['EffectType']=32,['Z']=45940.735900,['Color']=10099,},[5]={['SizeY']=600,['Alpha']=1,['SizeZ']=600,['SizeX']=600,['Roll']=0,['Id']=1381,['Pitch']=0,['Y']=14959,['Color']=494949,['Yaw']=3.063053,['X']=22782.015331,['Groups']=0,['Contrast']=1,['EffectType']=914,['Z']=45934.828530,['MetaData']={['target effect']=99990001,},},[6]={['SizeY']=1000,['Alpha']=1,['SizeZ']=1000,['SizeX']=1000,['Roll']=0,['Id']=1382,['Pitch']=0,['Y']=14879,['Color']=494949,['Yaw']=2.234021,['X']=22705.873724,['Groups']=0,['Contrast']=1,['EffectType']=1004,['Z']=45702.435187,['MetaData']={['furniture']='4730716583155844661',},},[7]={['SizeY']=1,['Alpha']=0.250000,['SizeX']=4000,['Roll']=0,['Id']=1385,['Yaw']=1.382301,['SizeZ']=4000,['X']=21419.259345,['Y']=15645,['Pitch']=0,['Groups']=0,['Contrast']=1,['EffectType']=63,['Z']=45741.298972,['Color']=999989,},[8]={['SizeY']=30,['Alpha']=1,['SizeZ']=30,['SizeX']=26.456456,['Roll']=0,['Id']=1396,['Pitch']=4.712564,['Y']=12290,['Color']=628598,['Yaw']=6.038839,['X']=23092.827275,['Groups']=0,['Contrast']=0.700000,['EffectType']=8503,['Z']=44327.994232,['MetaData']={['title']='A Note From Nezzokar',['message']='Dear Arvos,\\n    How could I not, when you have done much to accommodate me.\\n\\nP.S.  I have seen the way you decimate tea.  \\n    The kettles are necessary.',},},[9]={['Y']=12198,['Alpha']=0.700000,['SizeX']=60,['Roll']=0,['Id']=2151,['Yaw']=1.398009,['SizeY']=60,['Groups']=2,['X']=22533.947856,['Color']=148,['SizeZ']=60,['Contrast']=1,['EffectType']=4521,['Z']=44479.872465,['Pitch']=0,},[10]={['Y']=12253,['Alpha']=1,['X']=22529.855744,['SizeX']=20,['Roll']=0,['Id']=2152,['Yaw']=1.525418,['SizeY']=20,['Groups']=32768,['Color']=0,['Pitch']=0.436332,['SizeZ']=20,['Contrast']=4,['EffectType']=4406,['Z']=44463.777790,['MetaData']={['message']='O',},},},}"
