R["oh__@ahma'lyra"]="{['na']={[95]={['D']='Not long after the Ancient Anchor Inn was built, an unknown nobleman purchased the Ancient Anchor Berth. The contents of many heavy crates & chests were dispersed into the room very quicky. Afterwards, the nobleman left instructions that no one was to ever enter the room. Then he locked himself inside, never to be heard from again. What is the secret that the nobleman left in the room in the inn of Gonfalon Bay?',['N']='Sacred Secret Berth',['O']=19203,['C']=1.002000,},[25]={['D']='Trades-With-All, an Argonian Merchant, moved his family to Malabar Tol from Shadowfen, hoping to diplomatically open trade options. He did his best to make the family compound feel like home for his wife, Nabee, and daughter, Beetra.\\r\\nWith the Hist Tree\\'s approval and help to settle them in, his small family seems content with their surroundings and enjoys trying out the new things Papa brings in for his trades.\\r\\n\\r\\nBonus: find the \"baby\" doll; it\\'s not the one you think!',['C']=1.051000,['O']=19250,['N']='Junglefen Home',},[21]={['D']='Built long ago by House Indoril, at some point, the garden and part of the home were turned into a boutique. The garden is now slightly overgrown with some of the early ornamental installments still present.\\r\\n\\r\\nInside the original home is a fun, engaging gift shop filled with unusual baubles & plants. The workshop is a well-appointed place to clean and restore the unique objects found around Tamriel.\\r\\n\\r\\nIt appears as tho a certain hiccuping Alfiq has taken up residence in one of the displays...',['N']='Whimsy & Wonder',['O']=19212,['C']=1.051000,},[23]={['D']='Welcome to my Happy Home, a place for a Khajiit and her friends to relax and enjoy each other\\'s company. I am new to the ESO Housing Community and still figuring things out; this is my 1st simple deco build. Hope you enjoy!',['N']='Happy Home',['O']=19188,['C']=1.051000,},},['Key']='oh__@ahma\\'lyra',['Version']=1769,['TS']=1663525061,}"
