R["fx__eu__@djuske__37"]="{['Version']=1769,['TS']=1661591097,['Effects']={[1]={['SizeX']=150000,['Yaw']=0,['Groups']=0,['Roll']=0,['Color']=990076,['Y']=6009,['Id']=1242,['SizeY']=150000,['SizeZ']=150000,['Pitch']=0,['Z']=21205,['Alpha']=1,['EffectType']=13,['Contrast']=4,['X']=37032,},[2]={['SizeX']=100,['Yaw']=0,['Groups']=0,['Roll']=0,['Color']=494949,['Y']=0,['Id']=1243,['SizeY']=100,['SizeZ']=100,['Pitch']=0,['Z']=0,['Alpha']=1,['EffectType']=614,['Contrast']=1,['X']=0,},[3]={['SizeX']=14580,['Yaw']=0.944223,['Groups']=0,['Roll']=0,['Color']=990064,['Y']=21072,['Id']=1244,['SizeY']=4700,['SizeZ']=4700,['Pitch']=0,['Z']=21918.000276,['Alpha']=0.240000,['EffectType']=432,['Contrast']=3.300000,['X']=31439.525523,},[4]={['SizeX']=1600,['Yaw']=1.720895,['Groups']=0,['Roll']=0,['Color']=0,['Y']=21053,['Id']=1313,['SizeY']=1600,['SizeZ']=1600,['Pitch']=0,['Z']=22223.340082,['Alpha']=1,['EffectType']=906,['Contrast']=0.010000,['X']=29052.672927,},[5]={['SizeX']=26.456456,['Roll']=0,['Yaw']=4.932300,['Z']=22098.556961,['Groups']=0,['Color']=391116,['Y']=21093,['Id']=1316,['SizeZ']=30,['MetaData']={['title']='Talvazare\\'s journal',['message']='\\n\\nFirst entry\\nAureal tells me to write down my thoughts. Why? So she can spy on me? Absolutely not. Enjoy reading about nothing.\\n\\nSecond entry\\nFine. I don\\'t remember shit. I was part of Nocturnal\\'s invasion into the Coloured Rooms, I guess, and Meridia purified me as punishment. So now I don\\'t remember anything from before. Nocturnal doesn\\'t want me back. I guess the aureal thinks I should be grateful Azura has taken me in. I\\'m not staying, though. As soon as I can walk around without getting blinded by every little source of light, I am out.\\n\\nThird entry\\nThe aureal made me a dark room I can retreat to when everything gets too bright. I don\\'t know what her deal is. Clearly she enjoys humiliating me. I will not be utilising the room.\\n\\nFourth entry\\nFine. I guess I can believe the aureal genuinely wants me to be comfortable.  The dark room is nice. It\\'s not her fault I\\'m like this. She\\'s been nice enough... until Azura decides having a daedra branded by Meridia is too much of an eyesore.\\n\\nFifth entry\\nI told Jenalta I wouldn\\'t suddenly turn nice because she was nice to me. She said it would be a shame if I did. I... I\\'m not sure how to react to that. Perhaps I have misjudged her actions.',},['Pitch']=1.570971,['EffectType']=8503,['Contrast']=1,['SizeY']=30,['Alpha']=1,['X']=29140.309514,},[6]={['SizeX']=25,['Roll']=0,['Yaw']=3.773402,['Z']=21007.996755,['Groups']=0,['Color']=102439,['Y']=21352,['Id']=1317,['SizeZ']=50,['MetaData']={['title']='Jenalta\\'s journal',['message']='\\n\\nentry no. 13622\\nNice weather today. \\n\\n\\nentry no. 13623\\nNice weather today.\\n\\n\\nentry no. 13624\\nNice weather today.\\n\\n\\nentry no. 13625\\nNice weather today.\\n\\n\\nentry no. 13626\\nNice weather today.\\n\\n\\nentry no. 13627\\nNice weather today.\\n\\n\\nentry no. 13628\\nNice weather today.\\n\\n\\nentry no. 13629\\nNice weather today.\\n\\n\\nentry no. 13630\\nNice weather today.\\n\\n\\nentry no. 13631\\nNice weather today.\\n\\n\\nentry no. 13632\\nNice weather today.\\n\\n\\nentry no. 13633\\nNice weather today.',},['Pitch']=4.712564,['EffectType']=8503,['Contrast']=2.540000,['SizeY']=50,['Alpha']=1,['X']=35547.978167,},},}"
