R["fx__eu__@undrasil__86"]="{['TS']=1661278095,['Effects']={[1]={['Groups']=0,['Y']=9810,['Pitch']=0,['EffectType']=4406,['Id']=1025,['Z']=107536.150848,['MetaData']={['message']='Q',},['Roll']=0,['Color']=42,['SizeX']=120,['Contrast']=0.650000,['X']=108916.851735,['SizeZ']=140,['Alpha']=0.860000,['SizeY']=140,['Yaw']=1.389282,},[2]={['Groups']=0,['Y']=8732,['Pitch']=0,['EffectType']=4406,['Id']=1026,['Z']=103610.736756,['MetaData']={['message']='R',},['Roll']=0,['Color']=30,['SizeX']=100,['Contrast']=0.730000,['X']=106755.173834,['SizeZ']=160,['Alpha']=0.880000,['SizeY']=160,['Yaw']=4.625123,},[3]={['Groups']=0,['Y']=8437,['Pitch']=0,['EffectType']=4406,['Id']=1028,['Z']=98547.469343,['MetaData']={['message']='B',},['Roll']=0,['Color']=48,['SizeX']=100,['Contrast']=0.390000,['X']=109773.933548,['SizeZ']=140,['Alpha']=0.800000,['SizeY']=140,['Yaw']=3.403392,},[4]={['Groups']=0,['Y']=9475,['Pitch']=4.712564,['EffectType']=8502,['Id']=1035,['Z']=107100.697373,['MetaData']={['message']='Day one in the Varyond ruins. The way in is sealed, just like the stories said. But I finally found the first symbol, Quam. Exactly where the legends suggested it would be. No signs of the supposed guardian though. I wonder if that part of the myth was just a\\n\\n<The rest of the page is covered in blood>',['title']='Bloodied Journal',},['Roll']=0,['Color']=102439,['SizeX']=26.456456,['Contrast']=1,['X']=109300.385048,['SizeZ']=30,['Alpha']=1,['SizeY']=30,['Yaw']=1.570796,},[5]={['Groups']=0,['Y']=8429,['Pitch']=4.712564,['EffectType']=8501,['Id']=1036,['Z']=103434.568622,['MetaData']={['message']='The second symbol seems to be Roht. I took down the flame atronach that was guarding it as well. Damn bastard is still smoldering, even though its been fifteen minutes already. I might see if I can\\'t harvest some fire salts from it. Should make for a nice profit on the side.',['title']='Charred Note',},['Roll']=0,['Color']=102439,['SizeX']=26.456456,['Contrast']=1,['X']=106920.783295,['Siz