R["oh__@iop11"]="{['Key']='oh__@iop11',['na']={[64]={['C']=1.021000,['D']='I erect the spine of welcome. Change comes to all, even the xanmeer of times past. Mind the foliage, some is more opinionated than others.',['N']='Root-Conquers-Stone',['O']=19141,},[17]={['C']=1.026000,['D']='A wayward murder has turned this house into a gloam away from gloam.',['N']='Crow\\'s Roost',['O']=19141,},[82]={['C']=1.025000,['D']='Join our brave defenders in the battle of the book! Who could be behind such brazen book banditry? (see Kushalit Sanctuary)',['N']='Library in Peril',['O']=19141,},[31]={['C']=1.026000,['D']='Glorifying all things tusk. Ready to entertain visitors to the arena.',['N']='Tusk Lovers Club',['O']=19141,},[85]={['C']=1.016000,['D']='Fun activities and games! Cultural exploration! Exciting beverages! A selection of reading material from... Wait, where are those books coming from? (see Shalidor\\'s Shrouded Realm)',['N']='Camp Sheogorath',['O']=19141,},[70]={['C']=1.026000,['D']='The Lunar Champion erects the spine of welcome! Please, enjoy this celebration of this one\\'s adopted khajiiti way of life, and also dragon killing. Do not mind the Sithis shrine under the house.',['N']='Dragon Temple',['O']=19201,},[81]={['C']=1.026000,['D']='Adusa\\'s home away from home with her lovely Phedre, and their ja\\'khajiit. House Ravenwatch spreads its cold, welcoming arms to all.',['N']='Ravenwatch Outpost',['O']=19141,},[41]={['C']=1.030000,['D']='My personal outlaw refuge, with display area for particularly grand goods.',['N']='Outlaw\\'s Retreat',['O']=19210,},[73]={['C']=1.026000,['D']='Ember\\'s home. A street cat lives the high life, but there\\'s a bit of the street life tucked away, if you know where to look. One hidden room, one mildly out of the way room.',['N']='Ember\\'s Hearth',['O']=19205,},[26]={['C']=1.021000,['D']='My mini crafting hub. I really only make furnishings here.',['N']='Craft Complex',['O']=19141,},[60]={['C']=1.015000,['D']='I\\'ve hidden a number of decorative treasure chests around. There\\'s no prize, but I\\'d be impressed if you found them all.',['N']='Lost Cove',['O']=19141,},[44]={['C']=1.026000,['D']='Mirri\\'s house, full of the things she loves.',['N']='Elendis Manor',['O']=19141,},[49]={['C']=1.023000,['D']='Just your average, highly curated, orchard, featuring lovingly tended trees from across existence. Inside, you will find the delightful alchemical works that support the growth of such exotic specimens. The shrine to Hircine is simply there to ensure pesky herbivores keep far away from tender leaves. Do not concern yourself.',['N']='Totally Normal Trees',['O']=19201,},[94]={['C']=1.026000,['D']='Surface dwellers build on old ruins, and all who ride the waves are welcomed at the table. Below are the lore seekers, and the mysteries they love.',['N']='Sunken Seacrets',['O']=19205,},[63]={['C']=1.022000,['D']='Totally normal New Life festival. Don\\'t look behind the barn. Are they feeding people to that ice creature? What is going on in the tower?',['N']='Primal Winter Magic',['O']=19141,},},['TS']=1659749027,['Version']=1769,}"
