R["fx__eu__@djuske__39"]="{['TS']=1653834371,['Effects']={[1]={['Y']=15349,['SizeX']=220,['Yaw']=5.653121,['Groups']=0,['Contrast']=0.440000,['EffectType']=926,['SizeY']=220,['Id']=1288,['X']=76287,['Roll']=0,['SizeZ']=100,['Alpha']=1,['Pitch']=0,['Color']=689799,['Z']=29567,},[2]={['Y']=0,['SizeX']=100,['Yaw']=0,['Groups']=0,['Contrast']=1,['EffectType']=614,['SizeY']=100,['Id']=1290,['X']=0,['Roll']=0,['SizeZ']=100,['Alpha']=1,['Pitch']=0,['Color']=494949,['Z']=0,},[3]={['Y']=14469,['SizeX']=220,['Yaw']=5.667084,['Groups']=0,['Contrast']=0.500000,['EffectType']=926,['SizeY']=220,['Id']=1291,['X']=73929.645350,['Roll']=0,['SizeZ']=100,['Alpha']=1,['Pitch']=0,['Color']=556973,['Z']=32749.555795,},[4]={['Y']=14490,['SizeX']=220,['Yaw']=5.461135,['Groups']=0,['Contrast']=0.600000,['EffectType']=926,['SizeY']=220,['Id']=1292,['X']=74790.899870,['Roll']=0,['SizeZ']=100,['Alpha']=1,['Pitch']=0,['Color']=466166,['Z']=31634.911712,},[5]={['Y']=15335,['SizeX']=220,['Yaw']=4.263839,['Groups']=0,['Contrast']=0.500000,['EffectType']=926,['SizeY']=220,['Id']=1293,['X']=76717.161359,['Roll']=0,['SizeZ']=100,['Alpha']=1,['Pitch']=0,['Color']=556473,['Z']=29954.049265,},[6]={['Y']=1,['SizeX']=150000,['Yaw']=0,['Groups']=0,['Contrast']=1,['EffectType']=14,['SizeY']=150000,['Id']=1295,['X']=80693,['Roll']=0,['SizeZ']=150000,['Alpha']=1,['Pitch']=0,['Color']=89967,['Z']=23754,},[7]={['Y']=3187,['SizeX']=48.456456,['Yaw']=2.036799,['Color']=123423,['Contrast']=1.300000,['MetaData']={['title']='Watcher Sisi\\'s Journal',['message']='\\nEntry 1:\\nKnowledge is a worthwhile pursuit by its own merits. Collect knowledge for knowledge\\'s sake. I\\'ve always done this. Meticulously collected, organised, archived, even I can\\'t keep track of it all. But I want more. I want to use some of this knowledge! I want to test it, see if any of this actually makes sense! I want to see if I can keep a plant alive. Much of the litterature concerning them emphasize how difficult they are to care for. It will be a worthwhile challenge :)\\n\\nEntry 2:\\nI ventured into Tamriel. I gathered some plants, root and soil, and brought them with me back to Apocrypha to be planted. I colour-coordinated the flowers with their pots, and I must say it is going great so far :)\\n\\nEntry 3:\\nwhy won\\'t they grow why won\\'t they grow why won\\'t they grow why won\\'t they grow why won\\'t they grow why won\\'t they grow\\n\\nEntry 4:\\nOkay, I\\'ve narrowed down the cause of the failed propagation to a few factors. Firstly, the lack of a light/dark cycle might confuse the plants. Secondly, they require water - in some cases lots of it. But not too much! This balance is hard to strike. Thirdly, the air might be too dry for them here. I will acquire some plants who thrive in arid areas and see if they survive - if they do not, I am one step closer to figuring this out :)\\n\\nEntry 5:\\nThe plants did not survive - so is there a facet of Apocrypha itself that discourages plant growth? I know there to be plants and approximations of plants in other realms of Oblivion, so why not here? Does Lord Hermaeus Mora make Apocrypha inhospitable for plants on purpose? :(\\n\\nEntry 6:\\nThey grow! The trick was putting them in glass containers BEFORE coming back to Apocrypha, and providing enough water for them. I am tentatively hopeful! :)',},['EffectType']=8503,['SizeY']=55,['Id']=1296,['X']=80984,['Roll']=0,['SizeZ']=55,['Alpha']=1,['Pitch']=1.047198,['Groups']=0,['Z']=26866,},[8]={['Y']=3017,['SizeX']=220,['Groups']=0,['Color']=556472,['SizeY']=700,['EffectType']=926,['Contrast']=0.500000,['Id']=1334,['X']=80604,['Roll']=0,['SizeZ']=700,['Alpha']=1,['Pitch']=0,['Yaw']=4.263839,['Z']=26590,},[9]={['Y']=3058,['SizeX']=220,['Groups']=0,['Color']=556472,['SizeY']=700,['EffectType']=926,['Contrast']=0.500000,['Id']=1335,['X']=80542,['Roll']=0,['SizeZ']=700,['Alpha']=1,['Pitch']=0,['Yaw']=4.263839,['Z']=25202,},[10]={['Y']=3057,['SizeX']=180,['Groups']=0,['Color']=212428,['SizeY']=600,['Ef