R["fx__@grannyo"]="{['TS']=1602637269,['Houses']={[1]={['Effects']={[1]={['X']=158154,['SizeY']=360,['Roll']=0,['EffectType']=4500,['Id']=1046,['Yaw']=2.499311,['Pitch']=0,['SizeZ']=360,['SizeX']=360,['Alpha']=0.500000,['Contrast']=1,['MetaData']={['houseid']=71,['owner']='@ivory.crow',},['Color']=999999,['Groups']=0,['Z']=162035,['Y']=28013,},[2]={['X']=160995,['SizeY']=30,['Roll']=0,['EffectType']=8502,['Id']=1047,['Yaw']=2.553417,['Pitch']=4.736824,['SizeZ']=30,['SizeX']=26.456456,['Alpha']=1,['Contrast']=1,['MetaData']={['title']='\\'Portal Compendium\\'',['message']='I have written you this guide, since my warnings were not enough to dissuade you. This portal system is untested - not stable. I\\'ll accept no responsibility if any of my... hypotheses... come true. You have been thrice warned.\\n\\nThe orrery I have installed houses and protects the \"anchor\" soul gem. Do not lose this unique gem, I will not replace it. To create a portal, you must attune a lesser soul gem - the \"rock\" - to the anchor. Once you have decided where you will leave the rock, establish a connection between it and the anchor using the incantation I taught you. Understand the limitations: you may be shot to a random locale if interference occurs. Should the connection break while someone is travelling - they will be lost to Oblivion. Finally, the anchor requires charging every full moon, I\\'ve also showed you how this is done. Do not contact me again, unless you have more of what I want. - L\\n\\n1. Tiny Home (6 max)\\n2. Alik\\'r Alleyway Market (24) \\n3. Cozy Breton Tavern (24)\\n\\n4. Struggling Orc Port (24)\\n5. Rosewood Village (24)\\n6. Wood Elf Commune (12)\\n\\n7. Hidden Cemetery (12)\\n8. Blighted Bog (24)\\n9. Ancient Ayleid Library (24)',},['Color']=102439,['Groups']=0,['Z']=161514,['Y']=27902,},[3]={['X']=159529,['SizeY']=360,['Roll']=0,['EffectType']=4500,['Id']=1048,['Yaw']=2.527237,['Pitch']=0,['SizeZ']=360,['SizeX']=360,['Alpha']=0.500000,['Contrast']=1,['MetaData'